    "Remove parental control settings, continue?":["Remove parental control settings, continue?","Désactivation des réglages de contrôle parental, continuer?","Retire los ajustes de control parental, ¿continuar? ","Continuar com a remoção das definições de controlo parental?","إزالة إعدادات تحكم الولدين، متابعة؟","Удалить родительский контроль, продолжить?","清除家长控制设置，是否继续","ลบการตั้งค่าการควบคุมโดยผู้ปกครองออก ต้องการดำเนินการต่อหรือไม่","حذف تنظیمات کنترل والدین. ادامه می‌دهید؟","पेरेंटल कंट्रोल सेटिंगस हटाएं, आगे बढ़ें ?","Ota-onalar nazorati sozlamalari olib tashlansinmi?","Видалити батьківський контроль, продовжити?","הסר הגדרות בקרת הורים, האם להמשיך?","Hủy bỏ các cài đặt kiểm soát của cha mẹ, tiếp tục không?","မိဘ ထိန္းသိမ္းမႈ သတ္မွတ္ခ်က္မ်ား ဖယ္ရွားမည္၊ ဆက္လုပ္မလား?","Hapus pengaturan kontrol orang tua, lanjutkan?","Buang tetapan kawalan ibu bapa, teruskan?"],
    "It is going to enter startup navigation , PVR or time shift recording will be stopped, continue?":["It is going to enter startup navigation , PVR or time shift recording will be stopped, continue?","Le dispositif va démarrer la navigation, les enregistrements en différé ou PVR seront stoppés, continuer?","Va a entrar en el inicio de navegación, grabación de time shift o PRV se interrumpirá, ¿continuar? ","Vai iniciar a navegação, a gravação PVR ou time shift vai parar, deseja continuar?","بدء تشغيل الملاحة، PVR أو التحكم الزمني سوف يتوقف، متابعة؟","Включить навигацию при запуске, PVR или сдвиг записи по времени будут отключены, продолжить?","即将进入开机导航，PVR或者时移录制将会被停止，是否继续？","ระบบกำลังจะเข้าสู่การเริ่มต้นสืบค้น การบันทึกของ PVR หรือฟังก์ชันหยุดเวลา T.Shift จะถูกหยุดไว้ ต้องการดำเนินการต่อหรือไม่","در حال ورود به پیمایش راه‌اندازی اولیه. PVR یا تنظیم زمان متوقف خواهند شد. ادامه می‌دهید؟ ","अब स्टार्टअप नेविगेशन शुरू होगा, पीवीआर या टाईम शिफ़्ट रिकार्डिंग रूक जाएगी, आगे बढ़ें ?","Ishga tushirish navigatsiyasiga kirilmoqda , shaxsiy video yozgich yoki vaqtni surish bilan yozish to'xtatiladi, davom etilsinmi?","Увімкнути навігацію при запуску, PVR або зсув запису за часом будуть вимкнуті, продовжити?","נכנסים לניווט התחלה, הקלטת PVR או היסט זמן יופסקו, האם להמשיך?","Vào phần chuyển hướng khởi động, việc ghi lại PVR hoặc thay đổi thời gian sẽ được dừng lại, tiếp tục không?","၄င္းသည္ အစ ကူးေျပာင္းၾကည့္႐ႈမႈထဲသို႔ ဝင္သြားမည္၊ PVR (သို႔) အခ်ိန္ေျပာင္း မွတ္တမ္းကို ရပ္သြားေစမည္၊ ဆက္လုပ္မလား?","Anda akan membuka navigasi persiapan; PVR atau catatan pergantian waktu akan dihentikan, lanjutkan?","Ia akan memasuki navigasi startup, PVR atau rakaman peralihan masa akan berhenti, teruskan?"],
    "Restoration of factory settings will empty your personal settings and information, PVR or time shift recording will be stopped, continue? ":["Restoration of factory settings will empty your personal settings and information, PVR or time shift recording will be stopped, continue? ","Une réinitialisation aux réglages d'origine effacera vos informations et réglages personnels, les enregistrements en différé ou PVR seront stoppés, continuer?","La restauración de los ajustes de fábrica vaciará sus ajustes personales y la información, grabación de time shift o PRV se interrumpirá, ¿continuar?","O restauro para as definições de fábrica irá eliminar as suas definições e informações pessoais, a gravação PVR ou time shift será parada, deseja continuar? ","استعادة إعدادات المصنع سوف تعمل على تفريغ الإعدادات الشخصية الخاصة بك المعلومات، PVR أو التحكم الزمني سوف يتوقف، متابعة؟","Восстановление заводских настроек сотрет ваши персональные настройки и информацию, PVR или сдвиг записи по времени будут отключены, продолжить?","恢复出厂设置将会清空你的个人设置及个人信息，PVR或者时移录制将会被停止，是否继续？","การคืนค่าไปสู่การตั้งค่าจากโรงงานจะทำให้การตั้งค่าและข้อมูลส่วนตัวของคุณหายไป การบันทึกของ PVR หรือฟังก์ชันหยุดเวลาจะถูกหยุดไว้ ต้องการดำเนินการต่อหรือไม่","بازیابی تنظیمات کارخانه منجر به حذف تنظیمات و اطلاعات شخصی شما می‌شود. PVR یا تنظیم زمان متوقف خواهند شد. ادامه می‌دهید؟","फैक्ट्री सेंटिंग्स बहाल करने से निजी सेटिंग्स और सूचना मिट जाएगी, पीवीआर या टाईम शिफ़्ट रिकार्डिंग रूक जाएगी, आगे बढ़ें ?","Zavod sozlamalarini qayta tiklash natijasida shaxsiy sozlamalaringiz va ma'lumotlaringiz o'chiriladi, shaxsiy video yozgich yoki vaqtni surish bilan yozish to'xtatiladi, davom etilsinmi? ","Відновлення заводських налаштувань зітре ваші персональні налаштування та інформацію, PVR або зсув запису за часом будуть вимкнуті, продовжити?","שחזור הגדרות מפעל ינקה את ההגדרות והמידע האישיים שלכם, הקלטת PVR או היסט זמן יופסקו, האם להמשיך?","Khôi phục lại cài đặt của nhà sản xuất sẽ làm mất các cài đặt và thông tin cá nhân của quý vị, việc ghi lại PVR hoặc thay đổi thời gian sẽ được dừng lại, tiếp tục không? ","စက္႐ံုထုတ္ သတ္မွတ္ခ်က္မ်ား ျပန္ထားရွိျခင္းသည္ သင္၏ ကိုယ္ပိုင္ သတ္မွတ္ခ်က္မ်ားႏွင့္ အခ်က္အလက္ကို ဖ်က္သြားမည္၊ PVR (သို႔) အခ်ိန္ေျပာင္း မွတ္တမ္းကို ရပ္သြားေစမည္၊ ဆက္လုပ္မလား?","Pemulihan pengaturan pabrik akan menghapus informasi dan pengaturan pribadi Anda; PVR atau catatan pergantian waktu akan dihentikan, lanjutkan? ","Kemasukan semula tetapan kilang akan mengosongkan tetapan peribadi dan maklumat anda, rakaman PVR atau peralihan masa akan berhenti, teruskan?"],
