    "Adjust the Brightness level to generate lighter or darker images.":["Adjust the Brightness level to generate lighter or darker images.","Ajustez le niveau de luminosité pour produire des images plus claires ou plus foncées.","Ajustar el nivel de brillo para generar imágenes más claras o más oscuras.","Ajuste o nível de brilho para gerar imagens mais claras ou mais escuras.","ضبط مستوى السطوع للحصول على صور أفتح أو أغمق.","Отрегулируйте уровень яркости для получения более ярких или темных изображений.","","ปรับระดับความสว่างเพื่อให้สร้างภาพที่สว่างขึ้นหรือมืดลง","برای روشن‌تر یا تیره‌تر کردن تصاویر، درجه روشنایی را تنظیم کنید.","चित्रों को हलके या गहरे रंग का करने के लिए बाराईटनैस स्तर एडजस्ट करें","Yorqinroq yoki to'qroq tasvirlar hosil qilish uchun yorqinlik darajasini sozlang.","Відрегулюйте рівень яскравості для отримання більш яскравих або темних зображень.","כווננו את רמת הבהירות כדי ליצור תמונות בהירות או כהות יותר.","Điều chỉnh Độ sáng để tạo ra hình ảnh sáng hơn hay tối hơn.","ပိုလင္းသည့္ (သို႔) ပိုေမွာင္သည့္ ႐ုပ္ပံုမ်ား ထြက္ေစရန္ ေတာက္ပမႈအဆင့္ကို ညႇိပါ။","Menyesuaikan Kecerahan untuk mencerahkan atau meredupkan layar.","Laraskan tahap Kecerahan untuk menjana imej yang lebih cerah atau lebih gelap."],
    "Adjust the Contrast level to increase or decreae how bright images appear.":["Adjust the Contrast level to increase or decreae how bright images appear.","Ajustez le niveau de contraste pour augmenter ou diminuer la luminosité des images.","Ajustar el nivel de contraste para aumentar o disminuir el brillo con el que aparecen las imágenes.","Ajuste o nível de contraste para aumentar ou diminuir o quão brilhante as imagens aparecem.","ضبط مستوى التباين لزيادة أو تقليل كيفية اشراق عرض الصور.","Отрегулируйте уровень контраста для увеличения или уменьшения яркости изображений.","","ปรับระดับความคมชัดเพื่อเพิ่มหรือลดลักษณะปรากฎของความสว่างของภาพ","برای افزایش یا کاهش میزان شفافیت تصویر، درجه تضاد را تنظیم کنید.","चित्रों को हलके या गहरे रंग का करने के लिए कोंट्रास्ट स्तर एडजस्ट करें","Tasvirlarning yorqin ko'rinishini oshirish yoki kamaytirish uchun kontrast darajasini sozlang.","Відрегулюйте рівень контрасту для збільшення або зменшення яскравості зображень.","כווננו את רמת הניגודיות כדי להגביר או להקטין כמה בהיר התמונות יראו.","Điều chỉnh Độ tương phản để tăng hoặc giảm độ sáng hình ảnh xuất hiện.","ေတာက္ပသည့္ ပံုရိမ္မ်ား မည္သို႔ ေပၚေပါက္သည္ကို တိုးရန္ (သို႔) ေလွ်ာ့ရန္ အလင္းအေမွာင္အဆင့္ ညႇိပါ။","Menyesuaikan Kontras untuk mencerahkan atau meredupkan kecerahan gambar.","Laraskan tahap Kontras untuk meningkatkan atau mengurangkan kecerahan gambar."],
    "Adjust the color intensity of the picture for a more vibrant image.":["Adjust the color intensity of the picture for a more vibrant image.","Réglez l'intensité des couleurs de l'image pour une image plus éclatante.","Ajustar la intensidad de color de la imagen para obtener una imagen más vibrante.","Ajuste a intensidade da cor da imagem para uma imagem mais vibrante.","ضبط شدة لون الصورة للحصول على صورة أكثر حيوية.","Отрегулируйте интенсивность цвета для повышения красочности изображения.","","ปรับความเข้มของสีของภาพเพื่อภาพที่มีชีวิตชีวามากขึ้น","برای داشتن تصویری زنده‌تر، شدت رنگ را تنظیم کنید.","चित्रों के अच्छे रूप के लिए रंग को कम ज्यादा करें","Yanada jonli tasvir hosil qilish uchun tasvir ranglar intensivligini sozlang.","Відрегулюйте інтенсивність кольору для підвищення барвистості зображення.","כווננו את חוזק צבע התמונה כדי לקבל תמונה יותר חיה.","Điều chỉnh cường độ màu sắc của hình ảnh để hình ảnh sống động hơn.","ပိုမိုျမဴးႂကြသည့္ ႐ုပ္ပံုထြက္ေစရန္ ပံု၏ အေရာင္ ျပင္းအားကို ညႇိပါ။","Menyetel intensitas warna agar gambar nampak lebih hidup","Laraskan keamatan warna gambar untuk imej yang lebih bertenaga."],
    "Aspect Ratio":["Aspect Ratio","Format de l’image","Relación de aspecto","Proporção","نسبة العرض إلى الارتفاع","Соотношение сторон","","อัตราส่วนของมุมมอง","نسبت ابعاد","एस्पेक्ट रेशियो","Bo'y va en nisbati","Співвідношення сторін","יחס תצוגה","Tỷ Lệ Co","႐ႈေထာင့္ အခ်ဳိး","Rasio Aspek","Nisbah Aspek"],
    "Adjust the Aspect Ratio to stretch or zoom in on your picture.":["Adjust the Aspect Ratio to stretch or zoom in on your picture.","Réglez le format de l’image pour étirer ou agrandir votre image.","Ajustar la relación de aspecto para expandir o hacer zoom en la imagen.","Ajuste a proporção para esticar ou zoom em uma foto sua.","ضبط نسبة الارتفاع الى العرض لتمديد أو تكبير الصورة.","Подберите такое соотношение сторон, чтобы картинка поместилась на экране.","","ปรับอัตราส่วนภาพเพื่อลดขนาดหรือซูมเข้าบนภาพของคุณ","برای کشیدن یا بزرگنمایی تصویر خود، نسبت ابعاد را تنظیم کنید.","चित्र को ज़ूम करने के लिए एस्पेक्ट रेशियो को एडजस्ट करें","Tasvirni cho'zish yoki kattalashtirish uchun bo'y va en nisbatini sozlang.","Підберіть таке співвідношення сторін, щоб картинка помістилася на екрані.","כווננו את יחס רוחב גובה כדי למתוח או להגדיל את התמונה שלכם","Điều chỉnh Tỷ Lệ Co để thu hoặc phóng hình ảnh của quý vị","သင့္႐ုပ္ပံုတြင္ ျပန္႔ကားေစရန္ (သို႔) ပံုႀကီးခ်ဲ႕ရန္ ႐ႈေထာင့္ အခ်ဳိး ညႇိပါ။","Menyetel Rasio Aspek untuk memperlebar atau memperbesar gambar.","Laraskan Nisbah Aspek untuk meregangkan atau mengezum masuk pada gambar anda."],
