    "Skip a channel that your TV picked up during a previous channel scan search.":["Skip a channel that your TV picked up during a previous channel scan search.","Ignorez une chaîne que votre téléviseur a sélectionné lors d'une recherche de chaîne antérieure.","Omitir un canal que el televisor recogió durante una búsqueda anterior de canales.","Ir de um canal que a sua TV possuí durante uma pesquisa de exploração para o canal anterior.","تجاهل القتوات التي عثر عليها التلفزيون خلال البحث السابق.","Пропускает канал, который ТВ нашел во время последнего сканирования каналов.","","ข้ามช่องรายการที่ทีวีของคุณเลือกขึ้นมาในระหว่างการค้นหาสแกนช่องรายการก่อนหน้านี้","از کانالی که تلویزیون در اسکن کانال قبلی یافته است پرش کنید.","पिछले चैनल स्कैन में टीवी द्वारा रखे गए चैनल को छोड़ें","Oldingi galgi kanallar skanerlash izlovi davomida televizor tanlagan kanalni o'tkazib yuboring.","Пропускає канал, який ТВ знайшов під час останнього сканування каналів.","דלג על ערוץ שהטלוויזיה שלכם מצאה במהלך חיפוש ערוצים קודם.","Bỏ qua một kênh TV quý vị chọn trong quá trình quét kênh trước đó.","ယခင္ ခ်န္နယ္လိုင္း ရွာေဖြမႈတြင္ သင့္ TV ေရြးထားသည္ ခ်န္နယ္လိုင္းတစ္ခုကို ေက်ာ္သြားပါ။","Melewati saluran yang ditangkap oleh TV Anda selama pemindaian saluran sebelumnya.","Langkau saluran TV anda meningkat pada carian imbas saluran sebelumnya."],
    "Favorites List":["Favorites List","Liste des favoris","Lista de favoritos","Lista de Favoritos","قائمة المفضلة","Список избранного","","รายการที่โปรด","لیست علاقه‌مندی‌ها","फेवरिट्स सूचि","Sevimlilar ro'yxati","Список обраного","רשימת מועדפים","Danh Sách Yêu Thích","ႏွစ္သက္ရာ စာရင္း","Daftar favorit","Senarai Kegemaran"],
    "Quickly access your most-watched channels by creating a Favorites list.":["Quickly access your most-watched channels by creating a Favorites list.","Accédez rapidement à vos chaînes préférées en créant une liste de favoris.","Acceder rápidamente a los canales que más ve mediante la creación de una lista de favoritos.","Acesse rapidamente seus canais mais assistidos através da criação de uma lista de Favoritos.","الوصول بسرعة الى قنواتك الأكثر مشاهدة من قبل إنشاء قائمة المفضلة.","Создав список избранного, вы сможете быстро выбирать чаще всего просматриваемые каналы.","","เข้าถึงอย่างเร็วของช่องรายการที่คุณรับชมมากที่สุดโดยการสร้างรายการช่องโปรด","با ایجاد لیست علاقه‌مندی‌ها به کانال‌های مورد علاقه‌تان دسترسی سریع‌تر داشته باشید.","फेवरिट्स सूचि बना लें जिससे अपने सबसे अधिक देखे चैनलों तक जल्दी पहुंचें","Sevimlilar ro'yxatini yaratish orqali ko'p ko'radigan kanallaringizga tezda o'ting.","Створивши список обраного, ви зможете швидко вибирати канали, які найчастіше переглядаються.","כנסו במהירות לרשימת הערוצים שצפיתם בהם הכי הרבה ע\"י יצירת רשימת מועדפים.","Nhanh chóng truy cập các kênh được xem nhiều nhất của mình bằng cách tạo ra một Danh sách yêu thích.","ႏွစ္သက္ရာမ်ား စာရင္းတစ္ခုဖန္တီးၿပီး သင္ အၾကည့္ဆံုး ခ်န္နယ္လိုင္းမ်ား အျမန္ သြားလာၾကည့္႐ႈပါ။","Mengakses dengan cepat saluran yang paling sering Anda tonton dengan membuat daftar Favorit.","Cepat mengakses saluran paling menonton anda dengan mewujudkan satu senarai Kegemaran."],
