    "Set up the network to gain full access of Smart TV features.":["Set up the network to gain full access of Smart TV features.","Configurez le réseau pour obtenir un accès complet aux fonctionnalités de Smart TV.","Configurar la red para tener acceso completo a las funciones del TV Inteligente.","Configurar a rede para obter acesso completo aos recursos da Smart TV.","إعداد الشبكة للوصول الكامل الى ميزات التلفزيون الذكية.","Настройте сеть так, чтобы получить полный доступ к функциям Смарт ТВ.","","ตั้งค่าเครือข่ายเพื่อให้ได้รับการเข้าถึงอย่างเต็มที่ของคุณสมบัติสมาร์ททีวี","برای دسترسی کامل به قابلیت‌های تلویزیون هوشمند تلویزیون خود را تنظیم کنید.","स्मार्ट टीवी फीचर्स को पूरी तरह पाने के लिए नेटवर्क सेटअप करें","Smart TV funksiyalaridan to'liq foydalanish imkoniyatiga ega bo'lish uchun tarmoqni sozlang.","Налаштуйте мережу так, щоб отримати повний доступ до функцій Смарт ТВ.","הגדירו את הרשת כדי לקבל גישה מלאה למאפייני הטלוויזיה החכמה.","Cài đặt mạng để đạt được quyền truy cập đầy đủ các tính năng TV thông minh.","စမတ္ TV လကၡဏာရပ္မ်ား အျပည့္အဝ ရရွိႏိုင္ရန္ ကြန္ယက္ တပ္ဆင္ပါ။","Mengatur jaringan agar mendapat akses penuh dari fitur Smart TV.","Sediakan rangkaian untuk mendapatkan akses penuh ciri-ciri TV Pintar."],
