    "The custom name will be available after restart the TV.":["The custom name will be available after restart the TV.","Le nom personnalisé s’affichera après le redémarrage du téléviseur.","El nombre personalizado aparecerá después de reiniciar el televisor.","O nome personalizado estará disponível após reiniciar a TV.","سيكون اسم متاح بعد إعادة تشغيل جهاز التلفزيون.","Измененное имя будет активно после перезапуска ТВ.","","ชื่อที่กำหนดเองจะมีให้ใช้งานหลังจากรีสตาร์ตทีวี","نام سفارشی پس از راه‌اندازی مجدد تلویزیون نمایش داده خواهد شد.","नया नाम टीवी फिर से चलाने पर उपलब्ध होगा","Alohida qo'yilgan nom televizorni qayta ishga tushirgandan so'ng paydo bo'ladi.","Змінене ім'я буде активно після перезапуску ТВ.","השם המותאם אישית יהיה זמין לאחר הדלקה מחדש את הטלוויזיה.","Tên tùy chỉnh sẽ có sau khi khởi động lại TV.","TV ျပန္စၿပီးေနာက္ အသံုးျပဳသူအမည္ ရရွိႏိုင္မည္။","Nama kustom akan tersedia setelah TV di-restart.","Nama tersesuai boleh didapati selepas memulakan semula TV."],
    "Choose the location from where you will watch your TV.":["Choose the location from where you will watch your TV.","Choisissez le lieu depuis lequel vous regardez votre téléviseur.","Seleccionar la ubicación desde donde verá el TV.","Escolha o local de onde vai assistir TV.","اختيار موقع منه ستتمكن من مشاهدة التلفزيون الخاص بك.","Выберите место, с которого будете смотреть ТВ.","","เลือกตำแหน่งที่ตั้งจากสถานที่ที่คุณรับชมทีวีของคุณ","مکان تماشای تلویزیون را انتخاب کنید.","वह जगह चुनें जहां से आप टीवी देखेंगे","Telvizoringizni tomosha qiladigan joyni tanlang.","Виберіть місце, з якого будете дивитися ТВ.","בחרו את המיקום ממנו תצפו בטלוויזיה שלכם.","Chọn vị trí từ đó quý vị sẽ xem TV của quý vị.","သင္ TV ၾကည့္႐ႈမည့္ေနရာမွ အရပ္ေဒသကို ေရြးပါ။","Pilih lokasi Anda akan menonton TV.","Pilih lokasi dari mana anda akan menonton TV anda."],
