    "Auto Synchronization":["Auto Synchronization","Synchronisation automatique","Sincronización automática","Sincronização automática","تزامن تلقائي","Автосинхронизация","","การผสานรวมโดยอัตโนมัติ","همگام‌سازی خودکار","ऑटो सिंक्रोनाईज़ेशन","Avtomatik sinxronlash","Автосинхронізація","סינכרון אוטומטי","Đồng Bộ Hóa Tự Động","အလိုလို ကိုက္ညီေစျခင္း","Sinkronisasi Otomatis","Auto Penyegerakan"],
    "Set the date and time to automatically sync with the TV software server or cable provider.":["Set the date and time to automatically sync with the TV software server or cable provider.","Réglez la date et l'heure pour une synchronisation automatique avec le serveur du logiciel du téléviseur ou du fournisseur de câble.","Configurar la fecha y la hora para sincronizar automáticamente con el servidor de software de televisión o el proveedor de cable.","Defina a data e hora para sincronizar automaticamente com o servidor de software da TV por cabo.","ضبط التاريخ والوقت للمزامنة مع خادم برامج التلفزيون أو مزود الكابل تلقائيا.","Установите дату и время для автоматической синхронизации с провайдером телевизионного ПО или с провайдером кабельного ТВ.","","ตั้งค่าวันที่และเวลาเพื่อให้ซิงค์กับเซิร์พเวอร์ซอฟต์แวร์ทีวีหรือผู้ให้บริการเคเบิลของคุณ","تنظیم و همگام‌سازی تاریخ و زمان به طور خودکار با سرور نرم افزار تلویزیون و یا ارائه دهنده کابل.","टीवी साफ्टवेयर सर्वर या केबल प्रोवाईडर के साथ तिथी और समय ऑटोमेटिकली मिलाने के लिए सेट करें","Televizor dasturiy ta'minoti serveri yoki kabel xizmatlari provayderi bilan avtomatik sinxronlash uchun sana va vaqtni o'rnating.","Встановіть дату і час для автоматичної синхронізації з провайдером телевізійного ПЗ або з провайдером кабельного ТБ.","הגדירו את התאריך והשעה שיסונכרנו אוטומטית עם שרת תוכנת הטלוויזיה או ספק כבל.","Cài đặt ngày và thời gian để tự động đồng bộ với máy chủ phần mềm TV hoặc nhà cung cấp truyền hình cáp.","TV ေဆာ့ဖ္ဝဲ ဆာဗာ (သို႔) ႀကိဳးတပ္စက္ ပံ့ပိုးေပးသူနွင့္ အလိုအေလ်ာက္ ကိုက္ညီေစရန္ ေန႔စြဲႏွင့္ အခ်ိန္ သတ္မွတ္ပါ။","Mengatur tanggal dan waktu untuk menyinkronkan otomatis dengan server perangkat lunak TV atau penyedia layanan kabel.","Tetapkan tarikh dan masa untuk disegerakkan secara automatik dengan perisian pelayan atau pembekal TV kabel."],
