    "Set the time to display in a 12 or 24-hour format.":["Set the time to display in a 12 or 24-hour format.","Réglez l'heure à afficher dans un format 12 ou 24 heures.","Configurar la hora para mostrar un formato de 12 o 24 horas.","Ajustar a hora para ser exibida num formato de 12 ou 24 horas.","ضبط الوقت لعرضه في شكل 12 أو 24 ساعة.","Установите время либо в 12-ти, либо в 24-х часовой формат.","","ตั้งเวลาเพื่อให้แสดงผลในแบบ 12 หรือ 24 ชั่วโมง","تنظیم زمان برای نمایش در قالب 12 یا 24 ساعت.","12 या 24 घंटे के फोरमेट में समय दिखाने के लिए सेट करें","Vaqtni12 soatlik yoki 24 soatlik formatda ko'rsatishni tanlang.","Встановіть час або в 12-ти, або в 24-х годинний формат.","הגדירו את הזמן כך שיוצג בפורמט של 12 או 24 שעות.","Cài đặt thời gian hiển thị theo định dạng 12 hoặc 24 giờ.","အခ်ိန္ျပသရန္ ၁၂ နာရီ (သို႔) ၂၄-နာရီ ပံုစံ သတ္မွတ္ပါ။","Mengatur format tampilan waktu dalam siklus 12 atau 24 jam.","Tetapkan masa untuk dipaparkan dalam format 12 atau 24 jam."],
