    "Please enter with numerical keypad.":["Please enter with numerical keypad.","Veuillez utiliser le clavier numérique.","Utilizar el teclado numérico.","Por favor, indique com teclado numérico.","الرجاء إدخال القيم باستخدام لوحة المفاتيح الرقمية.","Введите с цифровой клавиатуры.","","กรุณาป้อนโดยใช้แป้นพิมพ์ตัวเลข","لطفا با صفحه کلید عددی وارد کنید.","नंबर वाले कीपैड से टाईप करें","Raqamlar klaviaturasi yordamida kiriting.","Введіть з цифрової клавіатури.","בבקשה הזינו עם מקלדת מספרים","Vui lòng nhập bàn phím số.","နံပါတ္ ကီးပက္ျဖင့္ ထည့္သြင္းပါ။","Masukkan dengan papan tombol numerik.","Sila masukkan dengan pad kekunci numerik."],
