    "Enable the Power On timer.":["Enable the Power On timer.","Activez la mise sous tension du minuteur.","Activar el temporizador de encendido.","Activar o temporizador de ligar automáticamente.","تمكين موقت التشغيل التلقائي.","Активируйте таймер включения.","","เปิดใช้งานตัวตั้งเวลาเปิด","تایمر روشن شدن را فعال کنید.","पावर ऑन के लिए टाईमर लगाएं","Quvvatni yoqish taymerini yoqish.","Активуйте таймер увімкнення.","אפשרו את טיימר ההפעלה.","Kích hoạt tính năng hẹn giờ Tắt Nguồn.","ပါဝါအဖြင့္ အခ်ိန္မွတ္စက္ ဖြင့္ပါ။","Mengaktifkan timer Daya hidup.","Aktifkan pemasa Kuasa Hidup."],
    "To make sure the setting effective, please keep the power on.":["To make sure the setting effective, please keep the power on.","Pour s’assurer que le paramétrage soit effectif, veuillez garder le téléviseur allumé.","Para asegurar la vigencia de la configuración, mantenga encendido.","Para se certificar que o ajuste é aplicado, por favor, mantenha o cabo de alimentação ligado.","للتأكد من تفعيل الاعدادادت، الرجاء اترك الجهاز قيد التشغيل..","Чтобы проверить, что настройка активирована, не отключайте питание.","","เพื่อให้แน่ใจว่าการตั้งค่าจะมีผลสำเร็จ กรุณาเปิดเครื่องไว้เสมอ","برای اطمینان از اعمال تنظیمات، تلویزیون را روشن نگه دارید.","सेटिंग लागू होने के लिए, कृप्या पावर न रखें ","Ushbu sozlama kuchga kirishi uchun quvvatni yoqilgan holatda qolishini ta'minlang.","Щоб перевірити, що налаштування активовано, не вимикайте живлення.","כדי להבטיח שההגדרות בעלות השפעה, בבקשה השאירו את המכשיר פועל.","Để chắc chắn rằng các cài đặt có hiệu quả, xin vui lòng bật TV lên.","သတ္မွတ္ခ်က္ ထိေရာက္မႈရွိေစရန္ ပါဝါဖြင့္ထားပါ။","Untuk memastikan pengaturan efektif, biarkan daya tetap hidup.","Untuk memastikan tetapan yang berkesan, sila simpan kuasa pada."],
