    "Set the clock for the time you want the TV to turn On automatically.":["Set the clock for the time you want the TV to turn On automatically.","Réglez l’heure pour que votre téléviseur s’allume automatiquement à l’heure souhaitée.","Configurar el reloj en la hora a la que quiere que el televisor se encienda automáticamente.","Acerte o relógio para a hora que quiser que a TV se ligue automaticamente.","ضبط الساعة التي تريد تشغيل التلفزيون تلقائيا.","Установите часы на время, в которое хотите, чтобы телевизор автоматически включился.","","ตั้งค่านาฬิกาสำหรับเวลาที่คุณต้องการให้ทีวีเปิดอัตโนมัติ","زمان روشن شدن خودکار تلویزیون را تنظیم کنید.","टीवी अपने आप कब ऑन हो वह समय सेट करें","Televizor avtomatik tarzda yoqiladigan soat vaqtini belgilang.","Встановіть годинник на час, у який хочете, щоб телевізор автоматично увімкнувся.","הגדירו את השעון אל הזמן שאתם רוצים שהטלוויזיה שלכם תופעל אוטומטית.","Cài đặt đồng hồ cho thời gian quý vị muốn TV bật nguồn tự động.","TV အလိုအေလ်ာက္ ဖြင့္လိုသည့္အခ်ိန္အတြက္ နာရီ သတ္မွတ္ပါ။","Mengatur jam kapan Anda menginginkan TV menyala otomatis.","Tetapkan masa untuk masa yang anda mahu TV untuk menghidupkan On secara automatik."],
    "Enable the Power Off timer.":["Enable the Power Off timer.","Activez la mise hors tension du minuteur.","Activar el temporizador de apagado.","Activar o temporizador de desligar a TV.","تفعيل مؤقت الإيقاف التلقائي","Активируйте таймер выключения.","","เปิดใช้งานตัวตั้งเวลาปิด","تایمر خاموش شدن را فعال کنید.","पावर ऑफ के लिए टाईमर लगाएं","Quvvatni o'chirish taymerini yoqish.","Активуйте таймер вимкнення.","הפעילו שעון עצר לכיבוי. ","Kích hoạt tính năng hẹn giờ Tắt Nguồn.","ပါဝါအပိတ္ အခ်ိန္မွတ္စက္ ဖြင့္ပါ။","Mengaktifkan timer Daya mati.","Aktifkan pemasa Mati Kuasa."],
    "Set the clock for the time you want the TV to turn Off automatically.":["Set the clock for the time you want the TV to turn Off automatically.","Réglez l’heure pour que votre téléviseur s’éteigne automatiquement à l’heure souhaitée.","Configurar el temporizador para cuando desee que el televisor se apague automáticamente.","Acerte o relógio para a hora que quiser que a TV se desligue automaticamente.","ضبط الساعة التي تريد ايقاف التلفزيون تلقائيا.","Установите часы на время, в которое хотите, чтобы телевизор автоматически выключился.","","ตั้งค่านาฬิกาสำหรับเวลาที่คุณต้องการให้ทีวีปิดอัตโนมัติ","زمان خاموش شدن خودکار تلویزیون را تنظیم کنید.","टीवी अपने आप कब ऑफ हो वह समय सेट करें","Televizor avtomatik tarzda o'chadigan soat vaqtini belgilang.","Встановіть годинник на час, у який хочете, щоб телевізор автоматично вимкнувся.","הגדירו את השעון לזמן שאתם רוצים שהטלוויזיה שלכם תכבה אוטומטית.","Cài đặt đồng hồ cho thời gian quý vị muốn TV tắt nguồn tự động.","TV အလိုအေလ်ာက္ ပိတ္လိုသည့္အခ်ိန္အတြက္ နာရီ သတ္မွတ္ပါ။","Mengatur jam kapan Anda menginginkan TV mati otomatis.","Tetapkan masa untuk masa yang anda mahu TV untuk menghidupkan Off secara automatik."],
