    "Set the sleep timer to automatically turn the TV Off within a specified time.":["Set the sleep timer to automatically turn the TV Off within a specified time.","Réglez la minuterie de mise en veille pour éteindre automatiquement le téléviseur selon un délai déterminé.","Configurar el temporizador de reposo para apagar automáticamente el TV en un plazo de tiempo determinado.","Definir o temporizador para ligar automaticamente a sua TV dentro de um tempo especificado.","ضبط مؤقت الاسبات ليتحول التلفزيون تلقائيا الى وضع الايقاف في غضون فترة زمنية محددة.","Установите время перехода в режим ожидания, чтобы автоматически выключить ТВ в заданное время.","","ตั้งค่าตั้งตั้งเวลาปิดเครื่อง เพื่อให้ปิดเครื่องอัตโนมัติภายในเวลาที่กำหนดไว้","قابلیت خاموش شدن خودکار تلویزیون در زمان مشخص شده را تنظیم کنید.","स्लीप टाईमर से टीवी अपने आप कब ऑफ हो वह समय सेट करें","Ma'lum vaqtdan so'ng televizor avtomatik tarzda o'chishi uchun uyqu taymerini belgilang.","Встановіть час переходу в режим очікування, щоб автоматично вимкнути ТВ в заданий час.","הגדירו את קוצב זמן השינה כך שהוא יכבה את הטלוויזיה באופן אוטומטי בזמן מסוים.","Cài đặt hẹn giờ ngủ để tự động tắt TV trong thời gian quy định.","သတ္မွတ္ထားသည့္ အခ်ိန္တြင္ TV အလိုအေလ်ာက္ ပိတ္ရန္အတြက္ ပိတ္ထားမႈ အခ်ိန္မွတ္စက္ သတ္မွတ္ပါ။","Mengatur timer tidur untuk mematikan TV otomatis setelah waktu yang ditetapkan.","Tetapkan pemasa tidur menjadi TV secara automatik Off dalam masa yang dinyatakan."],
