    "Block programs by channels when you turn On the Parental Controls feature.":["Block programs by channels when you turn On the Parental Controls feature.","Bloquez les programmes par chaîne lorsque vous activez la fonction de contrôle parental.","Bloquear los programas por canal cuando se enciende la función de control parental.","Programas de bloqueio de canais quando ligar o recurso Controlo Parental.","حظر برامج من قنوات عند تشغيل ميزة المراقبة الأبوية.","Блокирует программы канала, когда включена функция родительского контроля.","","บล็อกรายการโดยช่องเมื่อคุณเปิดคุณสมบัติการควบคุมโดยผู้ปกครอง","وقتی کنترل‌های والدین را روشن می‌کنید، برنامه‌ها بر اساس کانال مسدود می‌شوند.","पेरेंटल कंट्रोल फीचर ऑन करने पर चैनल्स के प्रोग्राम ब्लाक करें","Ota-onalar nazorati funksiyasini yoqqanda, dasturlarni kalanllar bo'yicha bloklang.","Блокує програми каналу, коли увімкнена функція батьківського контролю.","חסמו תכניות לפי ערוצים על ידי הפעלת פונקצית בקרת ההורים. ","Chặn các chương trình của kênh khi quý vị Bật tính năng Kiểm Soát của Cha Mẹ.","မိဘဆိုင္ရာ အထိန္း လုပ္ေဆာင္ခ်က္ ဖြင့္သည့္အခါ ပ႐ိုဂရမ္ကို ခ်န္နယ္လိုင္းမ်ားအရ တားဆီးပါ။","Program diblokir oleh saluran saat Anda mengaktifkan fitur Pengawasan Orang Tua.","Program Sekat oleh saluran apabila anda menghidupkan Mengenai Kawalan Ibu Bapa mempunyai."],
    "No channel information, please scan channl":["No channel information, please scan channl","Aucune information relatives à la chaîne. Veuillez rechercher les chaînes.","Sin información del canal. Buscar canales.","Nenhuma informação do canal, por favor digitar canal","لا توجد معلومات عن أي قناة، يرجى البحث عن قناة.","Нет информации о каналах, выполните сканирование каналов","","ไม่มีข้อมูลช่องรายการ กรุณาสแกนหาช่องรายการ","هیچ اطلاعات کانالی وجود ندارد. لطفا کانال را اسکن کنید","चैनल की सूचना नहीं, चैनल स्कैन करें","Kanal haqida ma'lumot yo'q, kanallarni skanerlang","Немає інформації про канали, виконайте сканування каналів","אין פרטי ערוץ, בבקשה בצעו סריקת ערוצים","Không có thông tin kênh, vui lòng quét kênh","ခ်န္နယ္လိုင္း အခ်က္အလက္မရွိပါ၊ ေက်းဇူးျပဳ၍ ခ်န္နယ္လိုင္း ရွာပါ","Tidak ada informasi saluran, harap pindai saluran","Tiada maklumat saluran, sila mengimbas channl"],
