    "Select the Closed Caption mode when you view an analog program.":["Select the Closed Caption mode when you view an analog program.","Sélectionnez le mode de sous-titrage lorsque vous visionnez un programme analogique.","Seleccionar el modo de subtítulos ocultos cuando ve un programa analógico.","Selecione o modo de fecho de captação quando está a ver um programa analógico.","حدد وضع تسمية توضيحية عند عرض برنامج تناظرية.","Выбрать режим кодированных субтитров при просмотре аналоговых программ.","","เลือกโหมดการบรรยายเสียงแบบปิดเมื่อคุณรับชมรายการอะนาล็อก","هنگام مشاهده برنامه آنالوگ، حالت زیرنویس بسته را انتخاب کنید.","अनालोग कार्यक्रम देखते समय क्लोस्ड कैपशन मोड चुनें","Analog dasturni tomosha qilganda, yashirin titr rejimini tanlang.","Вибрати режим кодованих субтитрів при перегляді аналогових програм.","בחרו במצב כתוביות לכבדי שמיעה כאשר אתם צופים בתוכנית אנלוגית. ","Chọn chế độ Phụ Đề khi quý vị xem một chương trình tương tự.","အနာေလာ့ ပ႐ိုဂရမ္တစ္ခု သင္ၾကည့္႐ႈေနသည့္အခါ ပိတ္ထားသည့္ ဇာတ္ညႊန္းစာတန္း အေနအထားကို ေရြးပါ။","Memilih mode Keterangan Gambar saat menonton program siaran analog.","Pilih mod Kapsyen Tertutup apabila anda melihat program analog."],
