    "Configure how to control CEC-enabled devices with your TV remote. ":["Configure how to control CEC-enabled devices with your TV remote. ","Configurez le contrôle des périphériques habilités CEC avec la télécommande de votre téléviseur. ","Configure cómo controlar los dispositivos de CEC habilitados con el control remoto del televisor. ","Configure como controlar dispositivos compatíveis com CEC com o comando da TV.","تكوين كيفية التحكم بالأجهزة التي تدعم CEC مع جهاز التلفزيون عن بعد.","Определите как управлять CEC-совместимыми устройствами с помощью ТВ-пульта ДУ.","","กำหนดตั้งค่าวิธีการควบคุมอุปกรณ์ที่เปิดใช้งาน CEC ด้วยรีโมททีวีของคุณ","نحوه کنترل دستگاه‌های مجهز به CEC را با کنترل از راه دور تلویزیون خود پیکربندی کنید.","CEC -चलित डिवाईसेज़ को अपने टीवी रिमोट से कंट्रोल करने के लिए कंफिगर करें","Televizoringiz masofa pulti yordamida CEC funksiyali qurilmalarni boshqarishni konfiguratsiyalang. ","Визначте як управляти CEC-сумісними пристроями за допомогою ТВ-пульта ДУ.","ערכו הגדרות על מנת לשלוט במכשירים בהם CEC פעיל והכל בעזרת שלט הטלוויזיה שלכם. ","Cấu hình cách để kiểm soát các thiết bị CEC-được kích hoạt tới điều khiển TV từ xa của quý vị. ","CEC သံုးႏိုင္သည့္ ကိရိယာမ်ားကို သင့္ TV အေဝးထိန္းကိရိယာျဖင့္ မည္သို႔ထိန္းခ်ဳပ္သည္ကို စီစဥ္လုပ္ေဆာင္ပါ။","Mengubah cara mengontrol perangkat yang diaktifkan CEC dengan remote TV. ","Konfigurasi bagaimana untuk mengawal peranti CEC yang dibolehkan dengan jauh TV anda."],
    "CEC control":["CEC control","Contrôle CEC","Control del CEC","Controlo CEC","تحكم CEC","Управление CEC","","การควบคุม CEC","کنترل CEC","CEC कंट्रोल","CEC boshqaruvi","Управління CEC","בקרת CEC","Kiểm soát CEC","CEC အထိန္း","Kontrol CEC","Kawalan CEC"],
    "Allow HDMI devices to control each other. ":["Allow HDMI devices to control each other. ","Autorisez les périphériques HDMI pour un contrôle réciproque. ","Permitir que los dispositivos HDMI se controlen entre sí. ","Permitir o acesso dos dispositivos HDMI para os controlar","سماح لأجهزة HDMI للتحكم بعضها البعض.","Разрешить HDMI-устройствам управлять друг другом.","","อนุญาติให้อุปกรณ์ HDMI ควบคุมซึ่งกันและกันได้","اجازه به دستگاه‌های HDMI برای کنترل یکدیگر.","एचडीएमआई डिवाईसेज़ को एक दूसरे को कंट्रोल करने दें","HDMI qurilmalar bir-birini boshqarishiga imkon bering. ","Дозволити HDMI-пристроям управляти один одним.","הניחו למכשירי HDMI לבקר אחד את השני. ","Cho phép các thiết bị HDMI kiểm soát lẫn nhau. ","HDMI ကိရိယာမ်ားကို တစ္ခုႏွင့္တစ္ခု ထိန္းခ်ဳပ္ခြင့္ျပဳပါ။","Supaya perangkat HDMI dapat saling mengontrol. ","Benarkan peranti HDMI untuk mengawal satu sama lain."],
    "Allow CEC-enabled devices to turn Off with the TV.":["Allow CEC-enabled devices to turn Off with the TV.","Activez les périphériques habilités CEC pour qu’ils s’éteignent avec le téléviseur.","Permitir que los dispositivos CEC habilitados se apaguen con el televisor.","Permitir o acesso aos dispositivos compatíveis com CEC para desligar a TV.","السماح للأجهزة التي تدعم CEC بإيقاف تشغيل التلفزيون.","Разрешить CEC-совместимым устройствам выключаться вместе с ТВ.","","อนุญาติให้อุปกรณ์ที่เปิดใช้งาน CEC ทำการปิดด้วยทีวีได้","اجازه به دستگاه‌های HDMI برای خاموش کردن تلویزیون.","सीइसी वाली डिवाईसेज़ को टीवी के साथ आफ होने दें","CEC funksiyali qurilmalarga televizoringiz bilan o'chish imkonini bering.","Дозволити CEC-сумісним пристроям вимикатися разом з ТВ.","הניחו למכשירים מופעלי-CEC להיכבות עם כיבוי הטלוויזיה. ","Cho phép các thiết bị CEC-được kích hoạt để Tắt TV.","CEC သံုးႏိုင္သည့္ ကိရိယာမ်ားကို TV ျဖင့္ပိတ္ရန္ ခြင့္ျပဳပါ။","Supaya perangkat yang diaktifkan CEC dapat dimatikan oleh TV.","Benarkan peranti CEC yang dibolehkan untuk menghidupkan Off dengan TV."],
    "Allow the TV to turn On with CEC-enabled devices.":["Allow the TV to turn On with CEC-enabled devices.","Activez le téléviseur pour qu’il s’allume avec les périphériques habilités CEC.","Permitir que el televisor se encienda con los dispositivos CEC habilitados.","Permitir que a TV ligue com dispositivos compatíveis com CEC.","السماح للتلفزيون بالتشغيل مع الأجهزة التي تدعم تحكم CEC","Разрешить ТВ включаться вместе с CEC-совместимыми устройствами.","","อนุญาติให้ทีวีเปิดอุปกรณ์ที่เปิดใช้งาน CEC","اجازه به تلویزیون برای روشن شدن با دستگاه‌های مجهز به CEC.","टीवी को सीइसी वाली डिवाईसेज़ से आन आफ होने दें","Televizoringizga CEC funksiyali qurilmalar bilan yonish imkonini bering.","Дозволити ТВ включатися разом з CEC-сумісними пристроями.","הניחו לטלוויזיה להידלק עם הפעלת מכשירים מופעלי-CEC. ","Cho phép TV Bật các thiết bị CEC-được kích hoạt.","TV ကို CEC သံုးႏိုင္သည့္ ကိရိယာမ်ားျဖင့္ ဖြင့္ရန္ ခြင့္ျပဳပါ။","Supaya TV dapat menyala dengan perangkat yang diaktifkan CEC.","Benarkan TV untuk menghidupkan On dengan peranti-CEC yang aktif."],
