    "Allow the Audio Receiver to send audio over an HDMI cable and back to or from your TV.":["Allow the Audio Receiver to send audio over an HDMI cable and back to or from your TV.","Activez le récepteur audio pour qu’il transmette l’audio sur un câble HDMI, vers ou depuis votre téléviseur.","Permitir que el receptor de audio envíe audio a través de un cable HDMI y lo haga hacia o desde el televisor.","Permitir que o receptor de áudio envie áudio através de um cabo HDMI e volta para ou a partir de sua TV.","السماح لمستقبل الصوت بإرسال الصوت عبر كابل HDMI والعودة إلى أو من جهاز التلفزيون.","Разрешить аудиоресиверу передавать звук по HDMI-кабелю на ТВ и обратно.","","อนุญาติให้ตัวรับเสียงส่งสัญญาณเสียงผ่านสายเคเบิล HDMI และกลับไปสู่หรือจากทีวีของคุณได้","اجازه به دریافت‌کننده صدا برای ارسال صدا از طریق کابل HDMI و بازگشت به یا از تلویزیون شما.","अपने टीवी में एचडीएमआई केबल के ज़रिए आडियो रिसिवर द्वारा आडियो बेजने की अनुमति दें","Audio qabul qiluvchiga HDMI kabel orqali audio signal jo'natish imkonini bering, televizorga yoki televizordan.","Дозволити аудіоресиверу передавати звук по HDMI-кабелю на ТВ і назад.","הניחו למקלט השמע לשלוח שמע דרך כבל HDMI וחזרה ממנו אל הטלוויזיה שלכם. ","Cho phép Thiết Bị Thu Âm Thanh gửi âm thanh qua một cáp HDMI và trở lại hoặc từ TV của quý vị.","ေအာ္ဒီယို လက္ခံကို သင့္ TV မွ (သို႔) ၄င္းသို႔ HDMI ႀကိဳးမွ ေအာ္ဒီယို ပို႔ခြင့္ျပဳပါ။","Supaya Penerima Audio dapat mengirim melalui kabel HDMI; dari atau ke TV Anda.","Benarkan Penerima Audio untuk menghantar audio ke atas kabel HDMI dan kembali ke atau dari TV anda."],
