    "Allow CEC-enabled devices to communicate with each other when connected through an HDMI cable.":["Allow CEC-enabled devices to communicate with each other when connected through an HDMI cable.","Autorisez les périphériques habilités CEC à communiquer les uns avec les autres lorsqu'ils sont connectés via un câble HDMI.","Permitir que los dispositivos CEC habilitados se comuniquen entre sí cuando se conectan a través de un cable HDMI.","Permitir que os dispositivos compatíveis com CEC se comuniquem uns com os outros quando conectado através de um cabo HDMI.","السماح للأجهزة التي تدعم CEC بالتواصل مع بعضهم البعض عند الاتصال عبر كابل HDMI.","Разрешить CEC-совместимым устройствам общаться друг с другом по HDMI-кабелю.","","อนุญาติให้อุปกรณ์ที่เปิดใช้งาน CEC ทำการสื่อสารระหว่างกันได้เมื่อเชื่อมต่อกันผ่านสายเคเบิล HDMI","اجازه به دستگاه‌های مجهز به CEC برای ارتباط با یکدیگر هنگام اتصال از طریق کابل HDMI."," सीइसी वाली डिवाईसेज़ जब एचडीएमआई केबल द्वारा जुड़ी हों तो उन्हे आपस में कमयूनिकेट करने दें","HDMI kabel yordamida ulanganda, CEC funksiyali qurilmalarga bir-biri bilan aloqa qilish imkoni bo'ladi.","Дозволити CEC-сумісним пристроям спілкуватися один з одним по HDMI-кабелю.","הניחו למכשירים מופעלי-CEC לתקשר אחד עם השני כשהם מחוברים בכבל HDMI. ","Cho phép các thiết bị CEC-được kích hoạt giao tiếp với nhau khi kết nối thông qua cáp HDMI.","HDMI ႀကိဳးတစ္ေခ်ာင္းမွတဆင့္ ခ်ိတ္ဆက္ထားစဥ္ CEC သံုးႏိုင္သည့္ ကိရိယာမ်ား တစ္ခုႏွင့္တစ္ခု ဆက္သြယ္ခြင့္ျပဳပါ။","Supaya perangkat yang diaktifkan CEC dapat saling berkomunikasi saat tersambung melalui kabel HDMI.","Benarkan peranti CEC yang dibolehkan untuk berkomunikasi antara satu sama lain apabila disambungkan melalui kabel HDMI."],
