    "Access the menu of connected HDMI CEC-enabled devices with the TV remote control.":["Access the menu of connected HDMI CEC-enabled devices with the TV remote control.","Accédez au menu des périphériques habilités CEC connectés via un câble HDMI à l’aide de la télécommande du téléviseur.","Acceder al menú de los dispositivos CEC habilitados conectados con HDMI con el control remoto del televisor.","Acesse o menu de dispositivos habilitados para HDMI CEC conectados com o comando da TV.","الوصول إلى قائمة الاجهزة التي تدعم CEC وتتواصل مع بعضهم البعض عند الاتصال عبر كابل HDMI باستخدام جهاز التحكم عن بعد.","Открыть меню подключенных по HDMI CEC-совместимых устройств с помощью ТВ-пульта ДУ.","","เข้าถึงเมนูของอุปกรณ์ที่เปิดใช้งาน HDMI CEC ที่เชื่อมต่อด้วยการใช้รีโมทคอนโทรลของทีวีของคุณ","با کنترل از راه دور تلویزیون به منوی دستگاه‌های مجهز به CEC متصل به HDMI دسترسی پیدا کنید.","टीवी रिमोट से कनेक्टेड एचडीएमाई सीइसी डिवाईसेज़ के मेनू में जाएं","Televizoringiz masofa pulti yordamida ulangan HDMI CEC funksiyali qurilmalar menyusiga kiring.","Відкрити меню підключених по HDMI CEC-сумісних пристроїв за допомогою ТВ-пульта ДУ.","היכנסו בעזרת השלט רחוק לתפריט מכשירים מופעלי-CEC המחוברים ב-HDMI.","Truy cập bảng chọn của các thiết bị HDMI CEC-được kích hoạt đã kết nối HDMI với điều khiển TV từ xa.","ခ်ိတ္ဆက္ထားသည့္ HDMI CEC သံုႏိုင္သည့္ ကိရိယာမ်ား မီႏူးကို TV ေဝးထိန္း ကိရိယာႏွင့္ သံုးခြင့္ရယူပါ။","Mengakses menu dari perangkat yang diaktifkan CEC yang tersambung melalui HDMI dengan remote control TV.","Mengakses menu HDMI CEC yang dibolehkan dengan peranti kawalan jauh TV."],
