    "Set your TV to automatically receive the latest firmware.":["Set your TV to automatically receive the latest firmware.","Réglez votre téléviseur pour mettre à jour automatiquement le micrologiciel.","Configurar su televisor para recibir automáticamente la última versión del firmware.","Ajuste o televisor para receber automaticamente o firmware mais recente.","ضبط جهاز التلفزيون للحصول تلقائيا على أحدث البرامج الثابتة.","Настройте ТВ на автоматическое получение последних прошивок.","","ตั้งค่าทีวีของคุณให้ได้รับเฟิร์มแวร์รุ่นล่าสุดโดยอัตโนมัติ","برای دریافت خودکار جدیدترین سیستم عامل، تلویزیون خود را تنظیم کنید.","अपने टीवी में नया फर्मवेयर आटोमेटिकली लाने के लिए सेट करें ","Televizoringizni mikrodastur oxirgi versiyasini avtomatik tarzda qabul qilishga sozlang.","Налаштуйте ТВ на автоматичне отримання останніх прошивок.","הגדירו את הטלוויזיה שלכם לקבל באופן אוטומטי את הקשחה העדכנית ביותר. ","Cài đặt TV của quý vị tự động nhận phần mềm hệ thống mới nhất.","သင္၏ TV ကို ေနာက္ဆံုးထြက္ ဖမ္းဝဲ အလိုအေလ်ာက္ လက္ခံရရွိရန္ သတ္မွတ္ပါ။","Mengatur TV untuk menerima firmware terbaru secara otomatis.","Tetapkan TV anda untuk menerima firmware terkini secara automatik."],
    "Check Firmware Upgrade":["Check Firmware Upgrade","Vérifier les mises à jour du micrologiciel","Comprobar la actualización de firmware","Verifique as actualizações de Firmware","فحص تحديث البرامج الثابتة","Проверить наличие обновления прошивки","","ตรวจสอบการอัปเกรดเฟิร์มแวร์","بررسی ارتقاء سیستم عامل","फर्मवेयर अपग्रेड चेक करें","Mikrodastur yangilovi borligini tekshirish","Перевірити наявність оновлення прошивки","בדוק עדכון קשחה","Kiểm Tra Nâng Cấp Phần Mềm Hệ Thống","ဖမ္းဝဲ အဆင့္ျမႇင့္မႈ စစ္ေဆးပါ","Periksa Peningkatan Firmware","Semak Naik Taraf Firmware"],
    "Check to ensure that your TV has received the latest firmware.":["Check to ensure that your TV has received the latest firmware.","Assurez-vous que votre téléviseur possède le dernier micrologiciel.","Comprobar para asegurarse de que su TV ha recibido el último firmware.","Verifique se o seu televisor recebeu o firmware mais recente.","افحص للتأكد من أن جهاز التلفزيون يعمل باحدث البرامج الثابتة.","Проверьте, установлена ли на вашем ТВ последняя версия прошивки.","","ตรวจสอบให้แน่ใจว่าทีวีของคุณได้รับเฟิร์มแวร์รุ่นล่าสุด","برای اطمینان از اینکه تلویزیون شما جدیدترین سیستم عامل را دریافت کرده است آن را بررسی کنید.","चेक करें कि आपके टीवी में नया फर्मवेयर हैं ","Televizoringizda mikrodastur oxirgi versiyasigacha yangilanganligini tekshiring.","Переконайтеся, що на вашому ТВ остання версія прошивки.","בדקו וודאו שהטלוויזיה שלכם קיבלה את הקשחה העדכנית ביותר. ","Kiểm tra để đảm bảo rằng TV của quý vị đã nhận được phần mềm hệ thống mới nhất.","သင္၏ TV တြင္ ေနာက္ဆံုးထြက္ ဖမ္းဝဲ ရရွိမႈ ေသခ်ာေစရန္ စစ္ေဆးပါ။","Memeriksa untuk memastikan TV Anda telah menerima firmware terbaru.","Semak untuk memastikan bahawa TV anda telah menerima firmware terkini."],
