    "Settings may take up to two minutes to complete":["Settings may take up to two minutes to complete","Les réglages prendront deux minutes maximum","Los ajustes pueden tardar hasta dos minutos en completarse","As configurações podem levar até dois minutos para ficarem completas","الإعدادات قد يستغرق فترة تصل الى دقيقتين حتى ينتهي","Активация настроек занимает до двух минут","设置可能需要至多2分钟来完成","การตั้งค่าอาจจะใช้เวลาไม่เกิน 2 นาทีในการทำให้สำเร็จ","تکمیل تنظیمات تا دو دقیقه طول می‌کشد.","सेटिंग्स पूरी होने में 2 मिनट तक लग सकते हैं","Sozlamalarni sozlash ikki daqiqagacha davom etishi mumkin.","Активація налаштувань займає до двох хвилин","עריכת ההגדרות יכולה לארוך כשתי דקות עד שתושלם","Việc cài đặt có thể mất đến hai phút để hoàn tất","သတ္မွတ္ခ်က္မ်ားသည္ ၿပီးစီးရန္ ႏွစ္မိနစ္အထိ ၾကာႏိုင္သည္","Pengaturan memerlukan waktu sampai dua menit untuk diselesaikan","Tetapan mungkin mengambil masa sehingga dua minit untuk selesai"],
    "Tap the Wifi protection button on your router, which may be called WPS or contain this symbol:":["Tap the Wifi protection button on your router, which may be called WPS or contain this symbol:","Appuyez sur le bouton de protection Wifi sur votre routeur, appelé aussi WPS ou contient ce symbole :","Pulse el botón de protección de Wifi en el router, que puede llamarse WPS o contener este símbolo:","As configurações podem levar até dois minutos para completar","اضغط على زر واي فاي محمي على جهاز التوجيه الخاص بك، الذي يمكن ان يكون تحت WPS أو يحتوي على هذا الرمز.","Нажмите кнопку защиты Wifi на роутере, на которой может быть нанесено WPS или такой символ:","轻按您路由器上的Wifi保护按钮，其可能被叫做WPS或含有此符号:","แตะที่ปุ่มการป้องกัน Wi-Fi บนเราท์เตอร์ของคุณ ซึ่งอาจจะเป็น WPS ที่ถูกเรียกหรือมีสัญลักษณ์นี้:","دکمه Wifi روی روتر خود را فشار دهید. ممکن است نام آن WPS یا حاوی این حروف باشد:","अपने राउटर पर वाईफ़ाई प्रोटेक्शन का बटन दबाईए, जिसे WPS कहते हैं या यह चिन्ह उसमें होगा : ","Marshrutlagichdagi Wi-Fi himoya tugmasini cherting, bu tugma \"WPS\" tugmasi deb atalishi yoki tugmada shu belgi bo'lishi mumkin:","Натисніть кнопку захисту Wifi на роутері, на якій може бути нанесено WPS або такий символ:","הקלישו על כפתור הגנת הרשת האל-חוטית (WiFi) שבנתב שלכם, אשר עשוי להיקרא גם WPS או לכלול את הסמל הבא:","Chạm vào nút bảo vệ Wifi trên bộ định tuyến của quý vị được gọi là WPS hoặc có chứa biểu tượng này:","သင္၏ ေရာက္တာတြင္ Wifi ကာကြယ္ေရး ခလုတ္ကိုႏွိပ္ပါ၊ ၄င္းကို WPS ဟု ေခၚႏိုင္သည္ (သို႔) ဤသေကၤတ ပါဝင္သည္ :","Ketuk tombol pelindung Wifi di router, yang disebut juga sebagai WPS atau yang memiliki simbol ini:","Ketik butang perlindungan Wifi pada router anda, yang boleh dipanggil WPS atau mengandungi simbol ini:"],
