    "Use the TV remote to adjust the volume and TV speaker is off.":["Use the TV remote to adjust the volume and TV speaker is off.","Utilisez la télécommande pour régler le volume et l'enceinte du téléviseur est éteint.","Utilice el control remoto de la TV para ajustar el volumen y el altavoz de la TV está apagado.","Use o comando da TV para ajustar o volume e alto-falante da TV que está desligada.","استخدام جهاز التحكم عن بعد التلفزيون لضبط مستوى الصوت وسماعة التلفزيون.","Используйте ТВ-пульт ДУ для регулирования громкости, когда динамик телевизора выключен.","","ใช้รีโมททีวีเพื่อปรับระดับเสียงและปิดลำโพง","برای تنظیم صدا در حالیکه بلندگوی تلویزیون خاموش است، از کنترل از راه دور تلویزیون استفاده کنید.","टीवी की आवाज़ एडजस्ट करने के लिए रिमोट का प्रयोग करें. और टीवी का स्पीकर ऑफ़ है","Tovush balandligini sozlash va televizor karnayini o'chirish uchun televizor masofa pultidan foydalaning.","Використовуйте ТВ-пульт ДУ для регулювання гучності, коли динамік телевізора вимкнений.","השתמשו בשלט הטלוויזיה כדי לכוון את עצמת השמע של הטלוויזיה ולכבות את הרמקולים. ","Sử dụng điều khiển TV từ xa để điều chỉnh âm lượng và tắt loa TV.","အသံ ညႇိရန္ႏွင့္ TV စပီကာ ပိတ္ရန္ TV အေဝးထိန္း ကိရိယာကို သံုးပါ။","Gunakan remote TV untuk mengatur volume dan speaker TV dalam keadaan mati.","Gunakan alat kawalan jauh TV untuk melaraskan kelantangan dan pembesar suara TV dimatikan."],
    "Use the amplifier or sound bar's remote control to adjust the volume.":["Use the amplifier or sound bar's remote control to adjust the volume.","Utilisez l'amplificateur ou la télécommande de la barre de son pour régler le volume .","Utilice el control remoto de la barra de sonido o amplificador para ajustar el volumen.","Use o amplificador ou o comando da barra de som para ajustar o volume.","استخدام مكبر للصوت أو عنصر تحكم شريط الصوت عن بعد لضبط مستوى الصوت.","Используйте пульт ДУ усилителя или саундбара для регулирования громкости.","","ใช้เครื่องขยายหรือรีโมทคอนโทรลของแถบเสียงเพื่อปรับระดับเสียง","برای تنظیم صدا، از تقویت‌کننده یا نوار صدا روی کنترل از راه دور استفاده کنید.","आवाज़ एडजस्ट करने के लिए एंप्लीफायर या साउंड बार के रिमोट कंट्रोल का प्रयोग करें ","Tovush balandligini sozlash uchun kuchaytirgich yoki tovush paneli masofa pultidan foydalaning.","Використовуйте пульт ДУ підсилювача або саундбара для регулювання гучності.","השתמשו בשלט רחוק של המגבר או של מערכת השמע כדי לכוון את עצמת השמע.","Sử dụng các bộ khuếch đại (Amply) hoặc điều khiển từ xa thanh âm thanh để điều chỉnh âm lượng.","အသံညႇိရန္ ခ်ဲ႕စက္ (သို႔) အသံဘား၏ အေဝးထိန္း ကိရိယာကို သံုးပါ။","Gunakan amplifier atau remote kontrol soundbar untuk mengatur volume","Gunakan penguat atau kawalan jauh bar bunyi untuk melaraskan kelantangan."],
