    "I have read and agree to the statement":["I have read and agree to the statement","J'ai lu et accepté la déclaration","He leído y estoy de acuerdo con la declaración","Li e concordei com a declaração","لقد قرأت وانا موافق على البيان","Я прочел заявление и согласен с ним","我已阅读并同意免责声明","ฉันได้อ่านและตกลงเห็นด้วยกับคำประกาศ","این بیانیه را خوانده و با آن موافقم","मैंने बयान पढ़ लिया औऱ सहमत हूं.","Men bayonotni o'qib chiqdim va uni qabul qilaman.","Я прочитав заяву і згоден з нею","קראתי והסכמתי להצהרה","Tôi đã đọc và đồng ý với thông cáo","ထုတ္ျပန္ခ်က္ကို ဖတ္႐ႈၿပီး သေဘာတူပါသည္","Saya telah membaca dan setuju dengan pernyataan di atas","Saya telah membaca dan bersetuju dengan pernyataan"],
    "If you do not accept the agreement, internet based functions and services will not be available.":["If you do not accept the agreement, internet based functions and services will not be available.","Si vous n'acceptez pas la déclaration, les fonctions et services liés à internet ne seront pas disponibles","Si no acepta el acuerdo, las funciones y los servicios basados ​​en Internet no estarán disponibles.","Se não aceitar o acordo, as funções e serviços que dependem da internet não estarão disponíveis.","إذا كنت لا توافق على هذه الاتفاقية، الوظائف والخدمات على الانترنت لن تكون متاحة.","Если вы не согласны с заявлением, интернет-функции и сервисы будут недоступны.","如您不同意免责声明，与网络相关的应用和服务将无法使用","หากคุณไม่ยอมรับข้อตกลง ฟังก์ชันและบริการบนอินเตอร์เน็ตจะไม่มีบริการ","در صورت عدم پذیرش این بیانیه، عملکردها و سرویس‌های اینترنتی موجود نخواهند بود.","अगर आप समझौते से सहमत नहीं हैं, तो इंटरनेट संबंधित फंक्शन औऱ सेवाएं उपलब्ध नहीं होंगी.","Agar kelishuv shartlarini qabul qilmasangiz, internet asosida ishlovchi funksiya va xizmatlardan foydalanib bo'lmaydi.","Якщо ви не згодні з заявою, інтернет-функції та сервіси будуть недоступні.","אם אינכם מקבלים את תנאי ההסכם, פונקציות ושירותים המבוססים על האינטרנט לא יהיו זמינים לכם. ","Nếu bạn không chấp nhận thỏa thuận, internet dựa trên các chức năng và dịch vụ sẽ không có sẵn.","သေဘာတူညီခ်က္ကို လက္မခံလွ်င္ အင္တာနက္ အေျခခံ လုပ္ေဆာင္ခ်က္မ်ားႏွင့္ ဝန္ေဆာင္မႈမ်ား ရႏိုင္မည္မဟုတ္ပါ။","Jika Anda tidak menerima kesepakatan, fungsi dan layanan berbasis internet tidak akan aktif.","Jika anda tidak menerima perjanjian itu, fungsi dan perkhidmatan berasaskan internet tidak boleh didapati."],
