    "Skip network setup":["Skip network setup","Passer les réglages réseau","Saltar configuración de red","Saltar a configuração da rede","تخطي إعداد الشبكة","Пропустить настройку сети","跳过网络设置","ข้ามการตั้งค่าเครือข่าย","عبور از تنظیم شبکه","नेटवर्क सेटअप छोड़ें","Tarmoqni sozlashni o'tkazib yuborish","Пропустити налаштування мережі","דלגו על עריכת הרשת","Bỏ qua cài đặt mạng","ကြန္ယက္ သတ္မွတ္ျခင္း ေက်ာ္သြားပါ","Lewati pengaturan jaringan","Langkau tetapan rangkaian"],
    "If you skip network setup, certain internet based functions and services will be unavailable. Sure to continue?":["If you skip network setup, certain internet based functions and services will be unavailable. Sure to continue?","Si vous passez les réglages réseau, certains services et fonctions liés à internet ne seront pas disponibles. Continuer?","Si omite la configuración de red, ciertas funciones y servicios basados ​​en Internet no estarán disponibles. ¿Desea continuar? ","Se saltar a configuração da rede, algumas das funções e serviços que dependem da internet não estarão disponíveis. Tem a certeza que quer continuar?","إذا تخطيت إعداد شبكة الاتصال، فان الظائف والخدمات المعينة على الانترنت تصبح غير متوفرة. تأكد من المتابعة؟","Если пропустить настройку сети, некоторые интернет-функциии и сервисы будут недоступны. Продолжить?","跳过网络设置后您将无法使用部分网络功能和服务，是否继续？","หากคุณข้ามการตั้งค่าเครือข่าย ฟังก์ชันและบริการบนอินเตอร์เน็ตบางรายการจะไม่มีบริการ","در صورت عبور از تنظیم شبکه، برخی سرویس‌های و عملکردهای اینترنتی از دسترس خارج خواهند شد. ادامه می‌دهید؟","अगर आप नेटवर्क सेटअप छोड़ देंगे तो कुछ इंटरनेट संबंधी फंक्शन और सेवाएं उपलब्ध न होंगी. आगे बढ़ें ?","Agar tarmoqni sozlashni o'tkazib yuborsangiz, internet asosida ishlovchi funksiya va xizmatlardan foydalanib bo'lmaydi. Davom etmoqchi ekaningizga ishonchingiz komilmi?","Якщо пропустити налаштування мережі, деякі інтернет-функції і сервіси будуть недоступні. Продовжити?","אם תדלגו על עריכת הרשת, חלק מהפונקציות והשירותים מבוססי-האינטרנט לא יהיו זמינים. האם אתם בטוחים שתרצו להמשיך? ","Nếu quý vị bỏ qua cài đặt mạng, mạng internet nhất định dựa trên các chức năng và dịch vụ sẽ không có sẵn. Chắn chắn tiếp tục không?","ကြန္ယက္ သတ္မွတ္ျခင္းကို ေက်ာ္သြားလွ်င္ တိက်သည့္ အင္တာနက္ အေျခခံ လုပ္ေဆာင္ခ်က္မ်ားႏွင့္ ဝန္ေဆာင္မႈမ်ား ရႏိုင္မည္မဟုတ္ပါ။ ဆက္လုပ္မလား?","Jika Anda melewati pengaturan jaringan, fungsi internet dan layanan tertentu tidak akan aktif. Anda yakin ingin melanjutkan?","Jika anda melangkau tetapan rangkaian, fungsi dan perkhidmatan berasaskan internet tertentu tidak akan tersedia. Pasti meneruskan?"],
