    "Search has yet to be started,is it necessary to skip this step?":["Search has yet to be started,is it necessary to skip this step?","La recherche n'a pas encore démarré, est-il nécessaire de passer cette étape?","La búsqueda aún no se ha iniciado, ¿es necesario saltar este paso? ","A procura ainda não foi iniciada, é necessário ignorar este passo?","البحث لم يتم بعد بدأ، غير أنه من الضروري تخطي هذه الخطوة؟","Поиск ещё не был начат, пропустить этот шаг?","尚未搜台，是否确认跳过","การค้นหายังไม่เริ่มต้น มีความจำเป็นต้องข้ามขั้นตอนหรือไม่","جستجو هنوز شروع نشده است. آیا لازم است از این مرحله عبور کنید؟","खोज अभी शुरू नहीं हुई है, क्या इस स्टेप को छोड़ आगे बढ़ना आवश्यक है ?","Izlash hali boshlangani yo'q, bu qadamni o'tkazib yuborish zarurmi?","Пошук ще не було розпочато, пропустити цей крок?","החיפוש עדיין לא התחיל, האם אתם חייבים לדלג על שלב זה?","Tìm kiếm vẫn chưa được bắt đầu, cần thiết để bỏ qua bước này?","ရွာေဖြမႈ စတင္ရမည္၊ ဤအဆင့္ကို ေက်ာ္သြားရန္ လိုအပ္သလား?","Pencarian belum dimulai, apakah perlu melewati langkah ini?","Cari masih belum bermula, adalah perlu untuk melangkau langkah ini?"],
    "More internet-based services and contents will be served after network settings are finished successfully.":["More internet-based services and contents will be served after network settings are finished successfully.","Plus de contenus et services liés à internet seront proposés une fois les réglages de réseau effectués avec succès.","Más servicios basados ​​en Internet y los contenidos que se proporcionan después de la configuración de red se terminan con éxito. ","Serão oferecidos mais serviços e conteúdos baseados na internet após concluir a configuração das definições de rede com sucesso.","سيتم تقديم المزيد من الخدمات االتي تعتمد على الإنترنت ومحتوياته بعد الانتهاء من إعدادات الشبكة بنجاح.","После завершения сетевых настроек будет доступно большее количество интернет-сервисов и контента.","网络设置成功后，您可以享受到更多来自互联网的服务和内容","บริการและเนื้อหาทางอินเตอร์เน็ตมากกว่าจะมีให้บริการหลังจากการตั้งค่าเครือข่ายสำเร็จแล้ว","سرویس‌ها و مطالب اینترنتی بیشتر پس از تنظیم موفق شبکه در دسترس خواهد بود.","नेट्वर्क सेटिंग्स के पूरा हो जाने के बाद अधिक इंटरनेट संबंधी सेवाएं और सामग्री उपलब्ध होगी.","Agar tarmoqni sozlash amalga oshirilganidan so'ng, internet asosida ishlovchi yana ko'pgina xizmatlar va kontentlardan foydalanish mumkin.","Після завершення мережевих налаштувань буде доступна більша кількість інтернет-сервісів і контенту.","שירותים ותכנים מבוססי אינטרנט נוספים יסופקו לכם אחרי שעריכת הגדרות הרשת תסתיים בהצלחה.","Nhiều dịch vụ và nội dung hơn trên internet sẽ được phục vụ sau khi cài đặt mạng kết thúc thành công.","ကြန္ယက္ သတ္မွတ္ခ်က္မ်ား ေအာင္ျမင္စြာ ၿပီးစီးၿပီးေနာက္တြင္ ေနာက္ထပ္ အင္တာနက္ အေျခခံ ဝန္ေဆာင္မႈမ်ားႏွင့္ ပါဝင္ခ်က္မ်ား ဝန္ေဆာင္ေပးမည္။","Lebih banyak layanan dan konten berbasis internet yang akan diberikan setelah pengaturan jaringan selesai.","Lebih banyak perkhidmatan berasaskan internet dan kandungan akan disampaikan selepas tetapan rangkaian selesai dengan jayanya."],
    "A Brand New Smart Era":["A Brand New Smart Era","Une toute nouvelle ère","Una era inteligente de nueva marca","Uma Era Smart Novinha em Folha","عصر جديد للتلفزيونات الذكية","Совершенно новая Smart Era","开启全新智能时代！","แบรนด์แห่งยุคสมาร์ทใหม่","دوره جدیدی از هوشمندی!","एक बिलकुल नया स्मार्ट युग","Yangicha Smart era","Абсолютно нова Smart Era","עידן חדש וחכם","Thương Hiệu Mới Cho Kỷ Nguyên TV Thông Minh","အသစ္စစ္စစ္ စမတ္ေခတ္","Era Kecerdasan yang Baru","Era Pintar Baharu"],
    "Please refer to instruction manual for more function introductions.":["Please refer to instruction manual for more function introductions.","Merci de vous référer au manuel d'instructions pour plus d'informations sur les fonctions.","Por favor, consulte el manual de instrucciones para más información sobre función.","Consulte o manual de instruções para introduções a mais funções.","يرجى الرجوع إلى دليل التعليمات لمزيد من المعلومات حول الوظائف.","Более подробную информацию о функциях можно найти в руководстве пользователя.","更多功能介绍，请参考说明书","กรุณาดูที่คู่มือการแนะนำสำหรับคำแนะนำของฟังก์ชันเพิ่มเติม","لطفا برای آشنایی با قابلیت‌های بیشتر به دفترچه راهنما رجوع کنید.","अधिक फंक्शन इंट्रोडक्शनस के लिए कृप्या नियम पुस्तिका पढ़ें","Funksiyalar haqida batafsil ma'lumot uchun yo'riqnomaga qarang.","Більш детальну інформацію про функції можна знайти в посібнику користувача.","בבקש עיינו במדריך ההוראות להסברים נוספים לגבי הפונקציות","Vui lòng tham khảo hướng dẫn sử dụng cho nhiều giới thiệu chức năng.","ေနာက္ထပ္ လကၡဏာရပ္ မိတ္ဆက္ေပးခ်က္မ်ားအတြက္ လမ္းညႊန္ခ်က္ လက္စြဲတြင္ ဖတ္႐ႈပါ။","Baca panduan penggunaan untuk membaca fungsi selengkapnya.","Sila rujuk arahan manual untuk lebih pengenalan fungsi."],
