    "In Home Mode, your TV will automatically adjust the brightness of your screen based on the ambient light in the room.":["In Home Mode, your TV will automatically adjust the brightness of your screen based on the ambient light in the room.","En Mode Accueil, votre téléviseur ajuste automatiquement la luminosité de votre écran en fonction de la lumière ambiante de la pièce.","En el Modo del Hogar, el televisor ajustará automáticamente el brillo de la pantalla en función de la luz ambiental en la sala.","No Modo Casa, o seu televisor ajusta automaticamente ao brilho do ecrã com base na luz ambiente na sala.","في وضع المنزل، سوف يتم ضبط سطوع الشاشة بناء على الإضاءة المحيطة في الغرفة تلقائيا.","В домашнем режиме телевизор автоматически подстраивает яркость экрана в зависимости от освещения в комнате.","","ในโหมดบ้าน ทีวีของคุณจะถูกปรับความสว่างของหน้าจอโดยอัตโนมัติโดยขึ้นอยู่กับแสงสว่างแวดล้อมของห้องคุณ","در حالت خانه، تلویزیون شما به طور خودکار روشنایی نمایشگر را بسته به میزان نور اتاق تنظیم می‌کند.","होम मोड में, आपका टीवी कमरे में लाईट के हिसाब से स्करीन की ब्राईटनैस एडजस्ट कर लेगा. ","Uy rejimida televizor xonadagi yorug'likka qarab ekran yorqinligini avtomatik tarzda sozlaydi.","У домашньому режимі телевізор автоматично підлаштовує яскравість екрану залежно від освітлення в кімнаті.","במצב בית, הטלוויזיה שלכם תכוון באופן אוטומטי את בהירות המסך שלכם בהתבסס על התאורה הסובבת בחדר. ","Trong Chế Độ Gia Đình, TV của quý vị sẽ tự động điều chỉnh độ sáng của màn hình dựa trên ánh sáng môi trường xung quanh trong phòng.","အိမ္သံုး အေနအထားတြင္ သင္၏ TV သည္ အခန္းတြင္းရွိ အလင္းေရာင္ရရွိမႈအေပၚ မူတည္ၿပီး ဖန္သားျပင္ ေတာက္ပမႈကို အလိုအေလ်ာက္ ညႇိသြားမည္။","Dalam Mode Home, TV Anda akan menyesuaikan kecerahan layar secara otomatis berdasarkan cahaya sekitar di dalam ruangan.","Dalam Mod Utama, TV anda secara automatik akan melaraskan kecerahan skrin anda berdasarkan cahaya ambien di dalam bilik."],
    "Select Store Mode if the TV will be on display in a retail setting. The TV will no longer be in Energy Star mode.":["Select Store Mode if the TV will be on display in a retail setting. The TV will no longer be in Energy Star mode.","Sélectionnez Mode Magasin si le téléviseur est destiné à être exposé dans un environnement commercial. Le téléviseur ne sera plus en mode Energy Star.","Seleccione El Modo de Comercial si la TV estará en exposición en un sitio comercial. La TV ya no estará en modo Energy Star.","Selecione o modo loja se a TV vai estar em exibição num ambiente de loja. A TV não estará mais no modo de economia de energia.","اختر وضع المتجر إذا كان التلفزيون سيعمل في في وضع التجزئة. التلفزيون لن يكون في وضع توفير الطاقة.","Выберите режим магазина, если телевизор будет выставлен на обозрение в магазине. После этого телевизор выйдет из режима Energy Star.","","เลือกโหมดร้านค้าหากทีวีจะถูกนำไปแสดงในการตั้งค่าร้านค้า ทีวีจะไม่อยู่ในโหมดของดาวพลังงานอีกต่อไป","اگر تلویزیون با تنظیمات خرد نمایش داده خواهد شد، حالت فروشگاه را انتخاب کنید. تلویزیون دیگر در حالت ستاره انرژی نخواهد بود.","अगर टीवी रीटेल सेटिंग में डिस्प्ले पर होगा तो स्टोर मोड सेलेक्ट करें. तब टीवी एनर्जी स्टार मोड में नहीं रहेगा.","Televizor do'kon peshtaxtasiga ko'zgazma qilib qo'yilgan bo'lsa, do'kon rejimidan foydalaning. Televizor Energy Star rejimida bo'lmaydi.","Виберіть режим магазину, якщо телевізор буде виставлений на огляд в магазині. Після цього телевізор вийде з режиму Energy Star.","בחרו במצב חנות אם הטלוויזיה תופיע בתצוגה של חנות קמעונאית. הטלוויזיה תצא ממצב כוכב-אנרגיה. ","Chọn Chế Độ Cửa Hàng nếu TV được hiển thị trong cài đặt bán lẻ. Các TV sẽ không còn ở chế độ Energy Star (Tiết Kiệm Năng Lượng).","TV သည္ ေရာင္းခ်လိုက္သည့္ သတ္မွတ္ခ်က္တြင္ ၾကည့္႐ႈမည္ဆိုလွ်င္ စတိုးဆိုင္ အေနအထားကို ေရြးပါ။ TV သည္ စြမ္းအင္ ၾကယ္ပံုရ အေနအထားတြင္ ရွိေတာ့မည္မဟုတ္ပါ။","Pilih Mode Toko jika TV akan dipajang di toko. TV tidak akan berada pada mode Energy Star.","Pilih Mod Kedai jika TV yang akan dipamerkan dalam suasana yang runcit. TV ini tidak lagi akan berada dalam mod Energy Star."],
