    "CI Plus Network change, you may search to update network!":["CI Plus Network change, you may search to update network!","Modification Réseau CI Plus, il est recommandé de rechercher des mises à jour réseau!","Cambio de red plus CI - usted puede buscar para actualizar la red","Alteração da Rede CI Plus, pode procurar para atualizar a rede!","تغييرت شبكة CI+، يمكن البحث لتحديث الشبكة!","Сеть CI Plus изменилась, можно выполнить поиск новой сети!","","เครือข่าย CI+ มีการเปลี่ยนแปลง คุณอาจทำการค้นหาเพื่ออัปเดทเครือข่าย!","تغییر شبکه CI Plus. برای ارتقاء شبکه می‌توانید جستجو کنید!","CI+ नेटवर्क बदलें, नेटवर्क को अपडेट करने के लिए खोजें","CI Plus tarmog'ini o'zgartirish, tarmoqni yangilash uchun izlashingiz mumkni!","Мережа CI Plus змінилася, можна виконати пошук нової мережі!","שינוי רשת CI Plus, אתם רשאים לחפש על מנת לעדכן את הרשת!","Thay đổi Mạng CI Plus, quý vị có thể tìm kiếm để cập nhật mạng!","CI Plus ကြန္ယက္ ေျပာင္းပါ၊ ကြန္ယက္ အပ္ဒိတ္လုပ္ရန္ သင္ ရွာႏိုင္သည္!","Jaringan CI Plus berubah, Anda dapat mencari untuk memperbarui jaringan!","Perubahan CI Plus Rangkaian, anda boleh mencari untuk mengemaskini rangkaian!"],
