    "CI Plus Network search schedule time reached,you may search to update network!":["CI Plus Network search schedule time reached,you may search to update network!","Durée planifiée pour la recherche de Réseau CI Plus atteinte, il est recommandé de rechercher des mises à jour réseau!","Programación de búsqueda de red Plus CI alcanzada - puede buscar para actualizar la red","Hora de agendamento de procura da Rede CI Plus atingida, pode procurar para atualizar a rede!","انتهت مهلة زمن جدولة شبكة CI+ ، يمكنك البحث لتحديث الشبكة!","Пришло время поиска сети CI Plus, можно выполнить поиск новой сети!","","ถึงเวลาตามที่กำหนดไว้สำหรับการค้นหาเครือข่าย CI+ คุณอาจทำการค้นหาเพื่ออัปเดทเครือข่าย!","زمان جستجوی برنامه‌ریزی‌شده شبکه CI Plus فرا رسیده است، می‌توانید برای به‌روزرسانی شبکه جستجو کنید! ","CI+ नेटवर्क खोजने का समय, नेटवर्क को अपडेट करने के लिए खोजें","CI Plus tarmog'ini izlash vaqtiga yetdi, tarmoqni yangilash uchun izlashingiz mumkni!","Прийшов час пошуку мережі CI Plus, можна виконати пошук нової мережі!","הגיע השעה לחיפוש הקבוע בלו\"ז של רשת CI+, אתם יכולים לחפש עדכון לרשת! ","Thời gian tiến độ tìm kiếm Mạng CI Plus đã đạt được, quý vị có thể tìm kiếm để cập nhật mạng!","CI Plus ကြန္ယက္ ရွာေဖြမႈ သတ္မွတ္ခ်ိန္ ရွာထားသည္၊ ကြန္ယက္ အပ္ဒိတ္လုပ္ရန္ သင္ ရွာႏိုင္သည္!","Waktu jadwal pencarian Jaringan CI Plus dicapai, Anda dapat mencari untuk memperbarui jaringan!","CI Plus Network masa jadual carian dicapai, anda boleh mencari untuk mengemaskini rangkaian!"],
