    "If all reservation records are erased or not?":["If all reservation records are erased or not?","Si toutes les réservations d'enregistrements sont effacées ou non?","¿Todos los registros de reserva se borran o no? ","Todos os registo de reserva são apagados ou não?","هل تريد مسح جميع التسجيلات المسبقله؟","Все зарезервированные записи стерты или нет?","是否清除所有预约记录","หากการบันทึกตามที่ตั้งเวลาทั้งหมดถูกลบแล้ว จะตกลงหรือไม่","همه ضبط های رزرو شده پاک شوند یا خیر؟","सारे रिज़र्वेशन रिकार्ड मिट गए या नहीं ?","Barcha zaxira yozishlar o'chirilsinmi yoki yo'qmi?","Всі зарезервовані записи стерті чи ні?","האם למחוק את כל ההקלטות השמורות או לא?","Liệu tất cả các lịch ghi âm được xoá hoàn toàn hay không?","ႀကိဳတင္မွတ္တမ္း အားလံုးကို ဖ်က္မလား (သို႔) မဖ်က္ဘူးလား?","Apakah semua rekaman terjadwal dihapus atau tidak?","Jika semua rekod tempahan dipadamkan atau tidak?"],
