    "Please close down or cancel either of the following tasks as no available resources are served.":["Please close down or cancel either of the following tasks as no available resources are served.","Merci de fermer ou annuler l'une ou l'autre des tâches suivantes du fait qu'aucune ressource disponible n'est proposée.","Por favor, cierre o cancele cualquiera de las siguientes tareas ya que no sirven los recursos disponibles. ","Feche ou cancele uma das tarefas que se seguem pois não há recursos disponíveis.","يرجى إغلاق أو إلغاء أي من المهام التالية لا توجد موارد متاحة.","Закройте или отмените любое из следующих заданий, т.к. не хватает ресурсов.","无空闲的资源可用，请关闭以下任意一个任务或取消","กรุณาปิดหรือยกเลิกภารกิจทั้งสองรายการต่อไปนี้เนื่องจากไม่มีทรัพยากรรองรับบริการ","لطفا یکی از برنامه‌های زیر را ببندید یا لغو کنید؛ زیرا منبعی برای آن وجود ندارد.","कृप्या निम्न में से कोई टास्क बंद करें या कैंसल करें , क्योंकि रेसोर्सेज़ नहीं हैं","Resurslar yo'qligi sababli quyidagi vazifalarni tugating yoki bekor qiling. ","Закрийте або скасуйте одне з наступних завдань, тому що не вистачає ресурсів.","בבקשה סגרו או בטלו את המשימות הבאות שכן אין משאבים זמינים המסופקים למכשיר. ","Vui lòng đóng hoặc hủy bỏ một trong các nhiệm vụ sau đây như là các nguồn được phục vụ không có sẵn.","ရင္းျမစ္မ်ား ရရွိႏိုင္မႈ မရွိသည့္အတြက္ ေအာက္ပါ လုပ္ငန္းမ်ားကို ပိတ္ပါ (သို႔) ပယ္ဖ်က္ပါ။","Tutup atau batalkan salah satu tugas berikut ini karena tidak ada informasi.","Sila menutup atau membatalkan mana-mana daripada tugas-tugas berikut kerana tidak ada sumber yang ada dihidangkan."],
    "Please close down or cancel either of the following tasks as the period of reservation expires and no available resources are served.":["Please close down or cancel either of the following tasks as the period of reservation expires and no available resources are served.","Merci de fermer ou annuler l'une ou l'autre des tâches suivantes du fait que la période de réservation est expirée et qu'aucune ressource disponible n'est proposée.","Por favor, cierre o cancele cualquiera de las siguientes tareas ya que el período de reserva expira y no sirven los recursos disponibles. ","Feche ou cancele uma das tarefas que se seguem pois o período de reserva expirou e não há recursos disponíveis.","يرجى إغلاق أو إلغاء أي من المهام التالية في فترة الحجز او أي من الخوادم متاحة.","Закройте или отмените любое из следующих заданий, т.к. период резервирования уже закончился и не хватает ресурсов.","预约到期，无空闲的资源可用，请关闭以下任意一个任务或取消","กรุณาปิดหรือยกเลิกภารกิจทั้งสองรายการต่อไปนี้เนื่องจากระยะเวลาของการตั้งเวลาไว้สิ้นสุดแล้วและไม่มีทรัพยากรรองรับบริการ","لطفا یکی از برنامه‌های زیر را ببندید یا لغو کنید؛ زیرا منبعی برای آن وجود ندارد و مدت زمان رزرو نیز منقضی شده است.","कृप्या निम्न में से कोई टास्क बंद करें या कैंसल करें , क्योंकि रेज़र्वेशन की समयसीमा खत्म हो गई है और कोई रेसोर्सेज़ नहीं हैं","Zaxira muddati o'tganligi va resurslar yo'qligi sababli quyidagi vazifalarni tugating yoki bekor qiling. ","Закрийте або скасуйте одне з наступних завдань, тому що період резервування вже закінчився і не вистачає ресурсів.","בבקשה סגרו או בטלו כל אחת מהמשימות הבאות שכן תקופת השמירה פגה תוקף ואין משאבים זמינים המסופקים למכשיר. ","Vui lòng đóng hoặc hủy bỏ một trong các nhiệm vụ sau đây như là thời hạn lịch trình đã hết và nguồn được phục vụ không có sẵn.","ႀကိဳတင္ကာလ ကုန္ဆံုးသြားၿပီး ရင္းျမစ္မ်ား ရရွိႏိုင္မႈ မရွိသည့္အတြက္ ေအာက္ပါ လုပ္ငန္းမ်ားကို ပိတ္ပါ (သို႔) ပယ္ဖ်က္ပါ။","Tutup atau batalkan salah satu tugas berikut ini karena periode penjadwalan berakhir dan tidak ada informasi.","Sila menutup atau membatalkan mana-mana daripada tugas-tugas berikut sebagai tempoh tempahan tamat dan tiada sumber yang ada dihidangkan."],
