    "This is the default city, if you delete it, the weather information will not display on the home page. Press OK to confirm deletion. You may set a city as default on the Add a city page.":["This is the default city, if you delete it, the weather information will not display on the home page. Press OK to confirm deletion. You may set a city as default on the Add a city page.","C'est la ville par défaut. Si vous la supprimez, les informations météorologiques ne s'afficheront pas sur la page d'accueil. Appuyez sur OK pour confirmer la suppression. Vous pouvez configurer une ville par défaut sur la page Ajouter une ville.","Esta es la ciudad por defecto. Si la elimina, la información meteorológica no se mostrará en la página de inicio. Presione OK para confirmar la eliminación. Una ciudad se puede establecer como predeterminada en la página Añadir una ciudad.","Esta é a cidade padrão, se a apagar, as informações do tempo não serão exibidas na página inicial. Pressione OK para confirmar a exclusão. Pode definir uma cidade como padrão na página.","هذه هي المدينة الافتراضية، إذا قمت بحذف ذلك، فإن معلومات الطقس لن تُعرض على الصفحة الرئيسية. اضغط على موافق لتأكيد الحذف. يمكن تعيين المدينة الافتراضية من صفحة إضافة المدينة.","Это город по умолчанию, если удалить его, информация о погоде не будет выводиться на домашнюю страницу. Нажмите OK для подтверждения удаления. Установить город по умолчанию можно на странице добавления города.","您删除的是关注城市，删除后将无法在首页显示天气状态，若您确认删除，请在其他城市页面按OK键设定为关注城市","นี่คือเมืองที่ตั้งค่าไว้ ถ้าคุณลบ ข้อมูลเกี่ยวกับอากาศจะไม่ถูกแสดงในหน้าหลัก กด OK เพื่อยืนยันการลบ คุณสามารถเลือกเมืองหลักได้โดยเพิ่มชื่อเมืองในหน้าเมนู","این شهر پیش‌فرض است، با حذف آن اطلاعات آب و هوا روی صفحه اصلی شما نمایش داده نخواهد شد. می‌توانید در صفحه «افزودن شهر» شهری را به عنوان پیش‌فرض تنظیم کنید.","यह डिफाल्ट शहर है, आगर आप इसे डिलीट करेंगे तो होम पेज पर मौसम की जानकारी नहीं दिखेगी. डिलीट करने के लिए ओके दबाएं. शहर एड करने वाले पेज पर आप शहर को डिफाल्ट पर सेट कर सकते हैं.","Bu sukut bo'yicha shahar, agar uni o'chirsangiz, ob-havo ma'lumoti bosh sahifada ko'rsatilmaydi. O'chirishni tasdiqlash uchun OK'ni bosing. Shahar qo'shish sahifasida sukut bo'yicha shaharni o'rnatishingiz mumkin.","Це місто за замовчуванням, якщо видалити його, інформація про погоду не буде виводитися на домашню сторінку. Натисніть OK для підтвердження видалення. Встановити місто за замовчуванням можна на сторінці додавання міста.","זוהי עיר ברירת המחדל, אם תמחקו אותה נתוני מזג האוויר לא יופיעו בעמוד הבית. לחצו על OK לאישור המחיקה. אתם יכולים להגדיר עיר כברירת המחדל בעמוד הוספת העיר. ","Đây là thành phố mặc định, nếu quý vị xóa nó, thông tin thời tiết sẽ không hiển thị trên trang chủ. Nhấn OK để xác nhận xóa. Quý vị có thể cài đặt một thành phố là mặc định trên trình Thêm một trang thành phố.","ဤၿမိဳ႕သည္ မူရင္းပါျဖစ္သည္၊ ၄င္းကို ဖ်က္ပစ္လွ်င္ မူလစာမ်က္ႏွာေပၚတြင္ မိုးေလဝသ အခ်က္အလက္ကို ျပသမည္မဟုတ္ပါ။ ဖ်က္ပစ္မႈ အတည္ျပဳရန္ အိုေကကိုႏွိပ္ပါ။ ၿမိဳ႕ထည့္သည့္ စာမ်က္ႏွာတြင္ ၿမိဳ႕တစ္ၿမိဳ႕ကို မူရင္းပါအျဖစ္ သတ္မွတ္ႏိုင္သည္။","Ini adalah kota default, jika Anda menghapusnya, informasi cuaca tidak akan ditampilkan di halaman beranda. Tekan OK untuk mengonfirmasi penghapusan. Anda dapat menetapkan sebuah kota sebagai default dari halaman Tambahkan kota.","Ini bandar lalai, jika anda memadamkannya, maklumat cuaca tidak akan dipaparkan pada halaman utama. Tekan OK untuk mengesahkan pemadaman. Anda boleh menetapkan bandar sebagai lalai pada halaman Tambahkan bandar."],
