    "This will reset all settings to factory default. Do you want to continue?":["This will reset all settings to factory default. Do you want to continue?","Ceci permet de réinitialiser tous les réglages d'usine par défaut. Voulez-vous continuer?","Esto restablecerá todos los ajustes a los valores de fábrica. ¿Quieres continuar?","Isso irá redefinir todas as configurações para os padrões de fábrica. Quer continuar?","سوف يتم إعادة ضبط كافة الإعدادات الافتراضية للمصنع. هل تريد المتابعة؟","Это приведет к сбросу всех настроек к заводским значениям. Продолжить?","","การทำงานนี้จะเป็นการรีเซ็ตการตั้งค่าทั้งหมดไปสู่ค่าเริ่มต้นจากโรงงาน คุณต้องการดำเนินการต่อหรือไม่","این همه تنظیمات را به پیش‌فرض برمی‌گرداند. ادامه می‌دهید؟","यह सारी सेटिंग को फैक्ट्री डिफाल्ट पर ले जाएगा. क्या आप करना चाहते हैं ?","Barcha sozlamalar zavod sukut bo'yicha qiymatlariga qaytariladi. Davom etmoqchimisiz?","Це призведе до скидання всіх налаштувань до заводських значень. Продовжити?","פעולה זו תאפס את ההגדרות לברירות המחדל שלהן. האם תרצו להמשיך?","Điều này sẽ cài đặt lại tất cả các cài đặt mặc định của nhà sản xuất. Quý vị muốn tiếp tục không?","၄င္းသည္ သတ္မွတ္ခ်က္အားလံုးကို စက္႐ံုထုတ္ မူရင္းမူပါ ျပန္သတ္မွတ္မည္။ ဆက္လုပ္မလား?","Ini akan me-reset semua pengaturan ke default pabrik. Anda ingin melanjutkan?","Ini akan menetapkan semula semua tetapan kepada lalai kilang. Adakah anda mahu teruskan?"],
