    "Do not remove the factory-installed apps.":["Do not remove the factory-installed apps.","Ne retirez pas les applications installées en usine.","No remueva las aplicaciones instaladas de fábrica","Não remova os aplicativos instalados de fábrica.","لا تقم بإزالة التطبيقات المثبتة من المصنع.","Не удаляйте приложения, установленные с завода.","预置应用不能卸载","อย่าลบแอพพลิชั่นค่าเริมต้นจากโรงงานออก!","برنامه‌های نصب‌شده توسط کارخانه را حذف نکن.","फैक्ट्री में लगे एप्स न हटाएं","Zavodda o'rnatilgan ilovalarni olib tashlamang.","Не видаляйте програми, встановлені з заводу.","אין להסיר יישומונים המותקנים בברירת מחדל. ","Không xóa các ứng dụng được cài đặt bởi nhà sản xuất.","စက္႐ံုထုတ္ ထည့္သြင္းထားသည့္ အက္ပ္မ်ား မဖယ္ထုတ္ရပါ။","Jangan hapus aplikasi dari pabrik.","Jangan keluarkan app yang dipasang di kilang."],
