    "Enhance viewing with improved sound quality and performance":["Enhance viewing with improved sound quality and performance","Améliore le visionnage avec un son de meilleure qualité et une meilleur performance.","Mejore la visualización con una mejor calidad y rendimiento de sonido","Melhorar a ver com a melhoria da qualidade e desempenho de som","تعزيز العرض مع تحسين جودة الصوت والأداء","Наслаждайтесь просмотром с улучшенным качеством звука и эффективностью","","เพิ่มความสามารถในการรับชมด้วยคุณภาพและสมรรถนะของเสียงที่ได้รับการปรับปรุงให้ดีขึ้น","باکیفیت و عملکرد بهینه، تجربه تماشای خود را بهبود ببخشید","काफी बेहतर साउंड क्वालिटी और परफोरमेंस के साथ देखने का मज़ा बढ़ाएं","Yuqori sifatli tovush va tasvirdan bahra oling","Насолоджуйтесь переглядом з поліпшеною якістю звуку і ефективністю","שפרו את חווית הצפייה ואת איכות הצליל והביצועים","Tăng cường xem với chất lượng và hiệu xuất âm thanh được nâng cao","အဆင့္ျမႇင့္ထားသည့္ အသံအရည္အေသြးႏွင့္ စြမ္းေဆာင္မႈတို႔ျဖင့္ ၾကည့္႐ႈမႈ ျမႇင့္တင္ပါ","Tingkatkan kualitas menonton dengan kualitas dan performa suara yang ditingkatkan","Meningkatkan tontonan dengan peningkatan kualiti dan prestasi bunyi"],
