    "Uncover hidden colors, vibrant contrast and better brightness for a more accurate image.":["Uncover hidden colors, vibrant contrast and better brightness for a more accurate image.","Mettre au jour les couleurs cachées, le contraste dynamique et une meilleure luminosité pour une image plus précise .","Descubra colores ocultos, contrastes vibrante y el mejor brillo para una imagen más precisa.","Descubra as cores escondidas, contraste vibrante e melhor brilho para uma imagem mais precisa.","كشف الألوان الخفية، والتباين الحيوي والسطوع الافضل للحصول على صورة أكثر دقة.","Выявляйте скрытые цвета, выразительный контраст и улучшенную яркость для получения более точных изображений.","","เปิดเผยสีที่ถูกซ่อนอยู่ ความคมชัดที่มีชีวืตชีวาและความสว่างที่ดีกว่าสำหรับภาพที่มีความแม่นยำมากขึ้น","رنگ‌های پنهان را آشکار کنید، تضاد زنده را ببینید و از روشنایی بهتر برای داشتن تصویر دقیق‌تر لذت ببرید.","अच्छी इमेज के लिए छुपे हुए रंगों, विविध कांट्रास्ट और बेहतर ब्राईटनेस को निकालें ","Yanada aniq tasvir uchun yashirin ranglar, jonli kontrast va yanada yaxshiroq yorqinlikni oching.","Виявляйте приховані кольори, виразний контраст і поліпшену яскравість для отримання більш точних зображень.","גלו צבעים חבויים, ניגודיות חיה ובהירות טובה יותר בשביל תמונות מדוייקות יותר","Khám phá các màu sắc ẩn, độ tương phản sống động và độ sáng tốt hơn cho một hình ảnh chính xác hơn.","ပိုမိုတိက်သည့္ ႐ုပ္ပံုထြက္ရန္ ဝွက္ထားသည့္အေရာင္မ်ား၊ ျမဴးႂကြသည့္ အေရာင္အေသြး ျခားနားခ်က္မ်ားႏွင့္ ပိုမို ေတာက္ပမႈမ်ား ေဖာ္ထုတ္ပါ။","Ungkap warna tersembunyi, kontras dan kecerahan yang lebih baik untuk gambar yang lebih akurat.","Dedahkan warna tersembunyi, kontras bertenaga dan kecerahan yang lebih baik untuk imej yang lebih tepat."],
